person_1_9([
["Person_Of_Interest_s01e09_1_0.01.02.287-0.01.05.216.mp3", "He's all yours.", ""],
["Person_Of_Interest_s01e09_1_0.01.05.053-0.01.09.771.mp3", "I already told the other Americans...", ""],
["Person_Of_Interest_s01e09_1_0.01.08.173-0.01.12.491.mp3", "I deliver fruits and vegetables.", ""],
["Person_Of_Interest_s01e09_1_0.01.10.893-0.01.13.942.mp3", "You deliver explosives for Al-Qaeda.", ""],
["Person_Of_Interest_s01e09_1_0.01.12.344-0.01.16.695.mp3", "Your cell is responsible for a suicide bomb", ""],
["Person_Of_Interest_s01e09_1_0.01.15.097-0.01.19.397.mp3", "that killed three U.S. soldiers in Fallujah.", ""],
["Person_Of_Interest_s01e09_1_0.01.17.799-0.01.20.966.mp3", "You should tell me the location", ""],
["Person_Of_Interest_s01e09_1_0.01.19.368-0.01.23.785.mp3", "of the remainder of those explosives.", ""],
["Person_Of_Interest_s01e09_1_0.01.22.187-0.01.25.587.mp3", "Talk to me,", ""],
["Person_Of_Interest_s01e09_1_0.01.23.989-0.01.29.291.mp3", "or else you're gonna have to talk to my boss.", ""],
["Person_Of_Interest_s01e09_1_0.01.27.693-0.01.30.742.mp3", "And believe me when I tell you,", ""],
["Person_Of_Interest_s01e09_1_0.01.29.144-0.01.33.879.mp3", "you don't want to talk to my boss.", ""],
["Person_Of_Interest_s01e09_1_0.01.34.082-0.01.37.015.mp3", "All right.", ""],
["Person_Of_Interest_s01e09_1_0.01.44.258-0.01.48.226.mp3", "Hello, Yusuf.", ""],
["Person_Of_Interest_s01e09_1_0.01.52.550-0.01.56.251.mp3", "Getting too close-- Enough already.", ""],
["Person_Of_Interest_s01e09_1_0.01.54.653-0.01.57.536.mp3", "She goes...Today.", ""],
["Person_Of_Interest_s01e09_1_0.01.55.938-0.02.00.122.mp3", "But it's got to be clean.", ""],
["Person_Of_Interest_s01e09_1_0.01.59.574-0.02.02.507.mp3", "You can't keep coming in here like this.", ""],
["Person_Of_Interest_s01e09_1_0.02.00.909-0.02.04.075.mp3", "I gotta go. Detective Carter?", ""],
["Person_Of_Interest_s01e09_1_0.02.02.477-0.02.06.044.mp3", "It's Mrs. Kovach here to bail out her husband.", ""],
["Person_Of_Interest_s01e09_1_0.02.04.446-0.02.07.012.mp3", "Again?", ""],
["Person_Of_Interest_s01e09_1_0.02.05.414-0.02.08.764.mp3", "Figured maybe you could talk to her.", ""],
["Person_Of_Interest_s01e09_1_0.02.07.166-0.02.10.432.mp3", "Thanks.", ""],
["Person_Of_Interest_s01e09_1_0.02.11.786-0.02.17.589.mp3", "I work homicide, Mrs. Kovach, okay?", ""],
["Person_Of_Interest_s01e09_1_0.02.15.991-0.02.19.558.mp3", "I'm the one who ha to investigate it", ""],
["Person_Of_Interest_s01e09_1_0.02.17.960-0.02.22.978.mp3", "when your husband finally beats you to death.", ""],
["Person_Of_Interest_s01e09_1_0.02.27.802-0.02.32.270.mp3", "Look, every time you tell us it was an accident,", ""],
["Person_Of_Interest_s01e09_1_0.02.30.672-0.02.35.106.mp3", "you're strengthening the story he's gonna use", ""],
["Person_Of_Interest_s01e09_1_0.02.33.508-0.02.38.109.mp3", "to get out of it-- That you were clumsy,", ""],
["Person_Of_Interest_s01e09_1_0.02.36.511-0.02.40.278.mp3", "accident-prone.", ""],
["Person_Of_Interest_s01e09_1_0.02.38.680-0.02.43.749.mp3", "Do you hear me?", ""],
["Person_Of_Interest_s01e09_1_0.02.42.151-0.02.47.169.mp3", "The stairs.", ""],
["Person_Of_Interest_s01e09_1_0.02.45.571-0.02.49.254.mp3", "I fell down the stairs.", ""],
["Person_Of_Interest_s01e09_1_0.02.52.994-0.02.56.961.mp3", "If he puts his hands on you again,", ""],
["Person_Of_Interest_s01e09_1_0.02.55.363-0.02.58.296.mp3", "call me.", ""],
["Person_Of_Interest_s01e09_1_0.02.59.834-0.03.05.153.mp3", "Sorry. I have to go.", ""],
["Person_Of_Interest_s01e09_1_0.03.07.475-0.03.10.992.mp3", "I don't know why you bother, Carter.", ""],
["Person_Of_Interest_s01e09_1_0.03.09.394-0.03.12.143.mp3", "You can't save 'em all.", ""],
["Person_Of_Interest_s01e09_1_0.03.10.545-0.03.14.329.mp3", "That's a homicide waiting to happen.", ""],
["Person_Of_Interest_s01e09_1_0.03.12.731-0.03.16.998.mp3", "Figured I'd try to stop one for a change.", ""],
["Person_Of_Interest_s01e09_1_0.03.15.400-0.03.19.117.mp3", "DNA came back on the shooter you winged a couple weeks ago.", ""],
["Person_Of_Interest_s01e09_1_0.03.17.519-0.03.20.786.mp3", "The guy who took a shot at you.", ""],
["Person_Of_Interest_s01e09_1_0.03.19.188-0.03.24.289.mp3", "Half the DNA matched Marlene Elias...", ""],
["Person_Of_Interest_s01e09_1_0.03.22.691-0.03.27.042.mp3", "The other half... Don Moretti.", ""],
["Person_Of_Interest_s01e09_1_0.03.26.911-0.03.32.714.mp3", "Carl Elias-- The bastard son you left to rot in the system", ""],
["Person_Of_Interest_s01e09_1_0.03.31.116-0.03.35.801.mp3", "after you murdered his mother almost 40 years ago.", ""],
["Person_Of_Interest_s01e09_1_0.03.34.203-0.03.37.001.mp3", "Your mistress.", ""],
["Person_Of_Interest_s01e09_1_0.03.35.403-0.03.38.670.mp3", "I told you before, sweetheart.", ""],
["Person_Of_Interest_s01e09_1_0.03.37.072-0.03.42.190.mp3", "I ain't the father of nobody by that name.", ""],
["Person_Of_Interest_s01e09_1_0.03.40.592-0.03.44.025.mp3", "DNA says otherwise, Don.", ""],
["Person_Of_Interest_s01e09_1_0.03.42.427-0.03.46.194.mp3", "You're a perfect match.", ""],
["Person_Of_Interest_s01e09_1_0.03.44.596-0.03.47.529.mp3", "And guess what.", ""],
["Person_Of_Interest_s01e09_1_0.03.45.931-0.03.49.898.mp3", "Your son's all grown up now.", ""],
["Person_Of_Interest_s01e09_1_0.03.48.300-0.03.54.703.mp3", "Just a few of his recent victims.", ""],
["Person_Of_Interest_s01e09_1_0.03.53.105-0.03.57.622.mp3", "Retired Detective Bernie Sullivan,", ""],
["Person_Of_Interest_s01e09_1_0.03.56.024-0.04.00.709.mp3", "your old capo Vincent Deluca.", ""],
["Person_Of_Interest_s01e09_1_0.04.02.396-0.04.06.197.mp3", "What is this? What do I care?", ""],
["Person_Of_Interest_s01e09_1_0.04.04.599-0.04.08.250.mp3", "I'm gonna die an old man in here.", ""],
["Person_Of_Interest_s01e09_1_0.04.06.652-0.04.10.051.mp3", "Maybe sooner than you think.", ""],
["Person_Of_Interest_s01e09_1_0.04.08.453-0.04.12.421.mp3", "You killed his mother, and you left him to the wolves.", ""],
["Person_Of_Interest_s01e09_1_0.04.10.823-0.04.16.057.mp3", "What do you think he's gonna do to you?", ""],
["Person_Of_Interest_s01e09_1_0.04.14.459-0.04.20.145.mp3", "I wouldn't expect any father's day cards.", ""],
["Person_Of_Interest_s01e09_1_0.04.18.547-0.04.22.230.mp3", "If you help me,", ""],
["Person_Of_Interest_s01e09_1_0.04.20.632-0.04.25.150.mp3", "I can offer you protective custody.", ""],
["Person_Of_Interest_s01e09_1_0.04.23.552-0.04.28.052.mp3", "Who do you think you're talking to?", ""],
["Person_Of_Interest_s01e09_1_0.04.26.454-0.04.31.523.mp3", "You don't get it. Elias can get to you anywhere.", ""],
["Person_Of_Interest_s01e09_1_0.04.29.925-0.04.35.444.mp3", "He can find someone you know, turn them on you.", ""],
["Person_Of_Interest_s01e09_1_0.04.33.846-0.04.36.561.mp3", "And you know what?", ""],
["Person_Of_Interest_s01e09_1_0.04.34.963-0.04.38.396.mp3", "It's not a question of if, but when.", ""],
["Person_Of_Interest_s01e09_1_0.04.36.798-0.04.41.900.mp3", "Telling me this guy already took out a cop,", ""],
["Person_Of_Interest_s01e09_1_0.04.40.302-0.04.44.836.mp3", "took a shot at you 'cause you got too close,", ""],
["Person_Of_Interest_s01e09_1_0.04.43.238-0.04.49.424.mp3", "and you came here to warn me, huh?", ""],
["Person_Of_Interest_s01e09_1_0.04.47.826-0.04.51.910.mp3", "Consider it a courtesy call.", ""],
["Person_Of_Interest_s01e09_1_0.04.52.330-0.04.56.965.mp3", "There a task force going after this Elias,", ""],
["Person_Of_Interest_s01e09_1_0.04.55.367-0.04.59.434.mp3", "or is it just you, detective?", ""],
["Person_Of_Interest_s01e09_1_0.04.57.836-0.05.00.936.mp3", "What is that supposed to mean?", ""],
["Person_Of_Interest_s01e09_1_0.04.59.338-0.05.05.190.mp3", "Way it looks from my side of the fence, you're all alone.", ""],
["Person_Of_Interest_s01e09_1_0.05.03.592-0.05.08.894.mp3", "Sounds to me like maybe he's coming after you.", ""],
["Person_Of_Interest_s01e09_1_0.05.13.935-0.05.17.702.mp3", "All units respond--", ""],
["Person_Of_Interest_s01e09_1_0.05.16.104-0.05.19.821.mp3", "Shooting at 168th and Audubon.", ""],
["Person_Of_Interest_s01e09_1_0.05.18.223-0.05.22.157.mp3", "I came as soon as I heard the description.", ""],
["Person_Of_Interest_s01e09_1_0.05.20.559-0.05.24.242.mp3", "Yeah, got a young African-American male", ""],
["Person_Of_Interest_s01e09_1_0.05.22.644-0.05.25.460.mp3", "gunned down on his way home.", ""],
["Person_Of_Interest_s01e09_1_0.05.23.862-0.05.26.745.mp3", "I got 9-millimeter casings all over the curb.", ""],
["Person_Of_Interest_s01e09_1_0.05.25.147-0.05.28.613.mp3", "Looks like it was a drive-by.", ""],
["Person_Of_Interest_s01e09_1_0.05.27.015-0.05.30.415.mp3", "Any witnesses see the car?", ""],
["Person_Of_Interest_s01e09_1_0.05.28.817-0.05.33.084.mp3", "In this neighborhood? You're kidding, right?", ""],
["Person_Of_Interest_s01e09_1_0.05.33.372-0.05.38.306.mp3", " Ronnie Middleton. - You knew this kid?", ""],
["Person_Of_Interest_s01e09_1_0.05.36.708-0.05.41.176.mp3", "He witnessed a shooting six months ago up in the Bronx.", ""],
["Person_Of_Interest_s01e09_1_0.05.39.578-0.05.44.479.mp3", "ID'd the shooter-- Neighborhood thug Hector Alvarez.", ""],
["Person_Of_Interest_s01e09_1_0.05.42.881-0.05.46.131.mp3", " this kid was a snitch? - Yeah.", ""],
["Person_Of_Interest_s01e09_1_0.05.44.533-0.05.49.434.mp3", "He got cold feet though. Recanted his testimony.", ""],
["Person_Of_Interest_s01e09_1_0.05.47.836-0.05.51.019.mp3", "D.A. Dropped the case.", ""],
["Person_Of_Interest_s01e09_1_0.05.49.421-0.05.52.571.mp3", "Looks like Hector found him.", ""],
["Person_Of_Interest_s01e09_1_0.05.50.973-0.05.54.356.mp3", "He won't get away with it again.", ""],
["Person_Of_Interest_s01e09_1_0.05.52.758-0.05.55.991.mp3", "Was Ronnie carrying?", ""],
["Person_Of_Interest_s01e09_1_0.05.54.393-0.06.00.128.mp3", "Yeah, just a, uh, cell phone, and that soda bottle.", ""],
["Person_Of_Interest_s01e09_1_0.05.58.530-0.06.02.998.mp3", "Mariquitas Cola?", ""],
["Person_Of_Interest_s01e09_1_0.06.01.400-0.06.05.650.mp3", "Mexican soda.", ""],
["Person_Of_Interest_s01e09_1_0.06.04.052-0.06.07.335.mp3", "They don't sell that everywhere.", ""],
["Person_Of_Interest_s01e09_1_0.06.05.737-0.06.11.673.mp3", "I think I know a place that does.", ""],
["Person_Of_Interest_s01e09_1_0.06.10.075-0.06.13.959.mp3", "And I know somebody saw something.", ""],
["Person_Of_Interest_s01e09_1_0.06.12.361-0.06.16.044.mp3", "Yeah, getting them to talk is another matter.", ""],
["Person_Of_Interest_s01e09_1_0.06.14.446-0.06.18.630.mp3", "I'm sure you'll charm something out of them, Fusco.", ""],
["Person_Of_Interest_s01e09_1_0.06.17.032-0.06.20.549.mp3", "You know, Carter,", ""],
["Person_Of_Interest_s01e09_1_0.06.18.951-0.06.22.467.mp3", "we've been working together for a while now.", ""],
["Person_Of_Interest_s01e09_1_0.06.20.869-0.06.25.186.mp3", "My friends call me \"Lionel.\" You got a first name?", ""],
["Person_Of_Interest_s01e09_1_0.06.23.588-0.06.27.939.mp3", "Sure. \"Detective.\"", ""],
["Person_Of_Interest_s01e09_1_0.06.27.741-0.06.32.894.mp3", "My name's Detective Fusco with the NYPD.", ""],
["Person_Of_Interest_s01e09_1_0.06.31.296-0.06.34.529.mp3", "If anyone has seen or heard anything", ""],
["Person_Of_Interest_s01e09_1_0.06.32.931-0.06.36.064.mp3", "pertaining to what happened here tonight,", ""],
["Person_Of_Interest_s01e09_1_0.06.34.466-0.06.38.733.mp3", "you can call me at--", ""],
["Person_Of_Interest_s01e09_1_0.06.37.135-0.06.40.485.mp3", "- I already have your card, Lionel.", ""],
["Person_Of_Interest_s01e09_1_0.06.38.887-0.06.42.787.mp3", "What the hell are you doing here?", ""],
["Person_Of_Interest_s01e09_1_0.06.41.189-0.06.44.072.mp3", "Just checking in.", ""],
["Person_Of_Interest_s01e09_1_0.06.42.474-0.06.46.575.mp3", "What happened here?", ""],
["Person_Of_Interest_s01e09_1_0.06.44.977-0.06.48.076.mp3", "Lead poisoning.", ""],
["Person_Of_Interest_s01e09_1_0.06.46.478-0.06.50.579.mp3", "It's going around the neighborhood.", ""],
["Person_Of_Interest_s01e09_1_0.06.51.949-0.06.55.500.mp3", "NYPD, mister...?", ""],
["Person_Of_Interest_s01e09_1_0.06.53.902-0.06.57.802.mp3", "Castillo. I'm-- I'm closed for the night.", ""],
["Person_Of_Interest_s01e09_1_0.06.56.204-0.06.59.804.mp3", "You see what happened out here tonight, Mr. Castillo?", ""],
["Person_Of_Interest_s01e09_1_0.06.58.206-0.07.01.172.mp3", "I was busy in the back.", ""],
["Person_Of_Interest_s01e09_1_0.06.59.574-0.07.04.259.mp3", "I-I-I didn't hear anything till the police showed up.", ""],
["Person_Of_Interest_s01e09_1_0.07.02.661-0.07.06.845.mp3", "See, I find that hard to believe, Mr. Castillo.", ""],
["Person_Of_Interest_s01e09_1_0.07.05.247-0.07.09.814.mp3", "After that young man bought this Mariquitas soda", ""],
["Person_Of_Interest_s01e09_1_0.07.08.216-0.07.12.183.mp3", "from your store...", ""],
["Person_Of_Interest_s01e09_1_0.07.10.585-0.07.15.654.mp3", "He walked out and got shot like a dog in the street.", ""],
["Person_Of_Interest_s01e09_1_0.07.16.257-0.07.20.158.mp3", "He bought the soda. He left the store.", ""],
["Person_Of_Interest_s01e09_1_0.07.18.560-0.07.22.077.mp3", "I heard the shots, but-- but I didn't see anything.", ""],
["Person_Of_Interest_s01e09_1_0.07.20.479-0.07.23.662.mp3", "Okay, so you heard shots.", ""],
["Person_Of_Interest_s01e09_1_0.07.22.064-0.07.25.830.mp3", "You didn't look out, see a car take off?", ""],
["Person_Of_Interest_s01e09_1_0.07.24.232-0.07.28.283.mp3", "Please...", ""],
["Person_Of_Interest_s01e09_1_0.07.26.685-0.07.30.168.mp3", "Not here.", ""],
["Person_Of_Interest_s01e09_1_0.07.28.570-0.07.32.454.mp3", "I understand.", ""],
["Person_Of_Interest_s01e09_1_0.07.30.856-0.07.33.705.mp3", "Why don't you come down", ""],
["Person_Of_Interest_s01e09_1_0.07.32.107-0.07.35.590.mp3", "to the precinct tomorrow, give a statement?", ""],
["Person_Of_Interest_s01e09_1_0.07.33.992-0.07.36.741.mp3", "Just what you saw.", ""],
["Person_Of_Interest_s01e09_1_0.07.35.143-0.07.39.544.mp3", "Okay, I'll come down tomorrow.", ""],
["Person_Of_Interest_s01e09_1_0.07.48.122-0.07.51.856.mp3", "Mr. Reese? Where have you been?", ""],
["Person_Of_Interest_s01e09_1_0.07.50.258-0.07.53.975.mp3", "We've got another number.", ""],
["Person_Of_Interest_s01e09_1_0.07.52.377-0.07.56.194.mp3", "If you're gonna tell me Ronnie Middleton,", ""],
["Person_Of_Interest_s01e09_1_0.07.54.596-0.07.57.228.mp3", "you're a little late, Finch.", ""],
["Person_Of_Interest_s01e09_1_0.07.55.630-0.07.58.196.mp3", "Kid's already gone.", ""],
["Person_Of_Interest_s01e09_1_0.07.56.598-0.08.00.315.mp3", "What? Where are you?", ""],
["Person_Of_Interest_s01e09_1_0.07.58.717-0.08.02.767.mp3", "At the scene of a homicide,", ""],
["Person_Of_Interest_s01e09_1_0.08.01.169-0.08.04.602.mp3", "wondering how the machine can see one", ""],
["Person_Of_Interest_s01e09_1_0.08.03.004-0.08.05.687.mp3", "and miss another.", ""],
["Person_Of_Interest_s01e09_1_0.08.04.089-0.08.06.988.mp3", "I'm sorry, Mr. Reese.", ""],
["Person_Of_Interest_s01e09_1_0.08.05.390-0.08.10.375.mp3", "The machine detects acts of premeditation.", ""],
["Person_Of_Interest_s01e09_1_0.08.08.777-0.08.12.077.mp3", "And I'm afraid we've got a big problem", ""],
["Person_Of_Interest_s01e09_1_0.08.10.479-0.08.13.912.mp3", "with the one it's seeing right now.", ""],
["Person_Of_Interest_s01e09_1_0.08.12.314-0.08.16.548.mp3", "Whose number came up?", ""],
["Person_Of_Interest_s01e09_1_0.08.14.950-0.08.18.967.mp3", "Mutual friend of ours...", ""],
["Person_Of_Interest_s01e09_1_0.08.19.019-0.08.22.837.mp3", "Detective Carter.", ""],
["Person_Of_Interest_s01e09_1_0.08.35.848-0.08.39.949.mp3", "Want to tell me where you were last night?", ""],
["Person_Of_Interest_s01e09_1_0.08.38.351-0.08.41.768.mp3", "I was about to ask you the same thing.", ""],
["Person_Of_Interest_s01e09_1_0.08.40.170-0.08.44.070.mp3", " Working a new case. - There You go.", ""],
["Person_Of_Interest_s01e09_1_0.08.42.472-0.08.45.455.mp3", "Thank you.", ""],
["Person_Of_Interest_s01e09_1_0.08.43.857-0.08.47.373.mp3", "And I don't have the curfew.", ""],
["Person_Of_Interest_s01e09_1_0.08.45.775-0.08.49.492.mp3", "You weren't home when I called,", ""],
["Person_Of_Interest_s01e09_1_0.08.47.894-0.08.51.193.mp3", "and you didn't answer your cell, Taylor.", ""],
["Person_Of_Interest_s01e09_1_0.08.49.595-0.08.52.795.mp3", "I was only a half an hour late.", ""],
["Person_Of_Interest_s01e09_1_0.08.51.197-0.08.54.530.mp3", "Yeah. You're staying with grandma", ""],
["Person_Of_Interest_s01e09_1_0.08.52.932-0.08.56.216.mp3", "till I'm off this case.", ""],
["Person_Of_Interest_s01e09_1_0.08.54.618-0.08.57.717.mp3", "- Hey, Taylor. - Mmm.", ""],
["Person_Of_Interest_s01e09_1_0.09.00.290-0.09.04.807.mp3", "So I saw you got that, uh, homecoming dance", ""],
["Person_Of_Interest_s01e09_1_0.09.03.209-0.09.05.875.mp3", "coming up Friday.", ""],
["Person_Of_Interest_s01e09_1_0.09.04.277-0.09.07.727.mp3", "You gonna go?", ""],
["Person_Of_Interest_s01e09_1_0.09.06.129-0.09.09.929.mp3", "Yeah, it must be tough being a freshman.", ""],
["Person_Of_Interest_s01e09_1_0.09.08.331-0.09.12.015.mp3", "All the girls going out with the older guys.", ""],
["Person_Of_Interest_s01e09_1_0.09.10.417-0.09.14.550.mp3", "I already asked somebody.", ""],
["Person_Of_Interest_s01e09_1_0.09.12.952-0.09.16.402.mp3", " Really? - Yeah.", ""],
["Person_Of_Interest_s01e09_1_0.09.14.804-0.09.17.737.mp3", "Well, I want to meet her.", ""],
["Person_Of_Interest_s01e09_1_0.09.16.139-0.09.19.188.mp3", "- I'm gonna be late for school. - Uh-uh.", ""],
["Person_Of_Interest_s01e09_1_0.09.17.590-0.09.20.440.mp3", "I'm taking you. I have time.", ""],
["Person_Of_Interest_s01e09_1_0.09.18.842-0.09.22.859.mp3", "Stay.", ""],
["Person_Of_Interest_s01e09_1_0.09.21.261-0.09.26.062.mp3", "I thought I charged this thing.", ""],
["Person_Of_Interest_s01e09_1_0.09.24.464-0.09.28.164.mp3", " After you. - Thank you.", ""],
["Person_Of_Interest_s01e09_1_0.09.26.566-0.09.30.199.mp3", "Raised you well.", ""],
["Person_Of_Interest_s01e09_1_0.09.31.803-0.09.35.672.mp3", "Did you know she had a son?", ""],
["Person_Of_Interest_s01e09_1_0.09.34.074-0.09.36.956.mp3", "Didn't know you cared.", ""],
["Person_Of_Interest_s01e09_1_0.09.35.358-0.09.39.292.mp3", "No dad in the picture for some time.", ""],
["Person_Of_Interest_s01e09_1_0.09.37.694-0.09.43.096.mp3", "You been looking into the detective, Mr. Reese?", ""],
["Person_Of_Interest_s01e09_1_0.09.41.498-0.09.45.715.mp3", "It pays to know the person coming after you, Finch.", ""],
["Person_Of_Interest_s01e09_1_0.09.44.117-0.09.49.435.mp3", "Okay, they're leaving now. You'd better hurry up.", ""],
["Person_Of_Interest_s01e09_1_0.09.47.837-0.09.50.419.mp3", "Almost got it.", ""],
["Person_Of_Interest_s01e09_1_0.09.48.821-0.09.53.690.mp3", "Forget it. Get out of there now.", ""],
["Person_Of_Interest_s01e09_1_0.09.57.012-0.10.01.898.mp3", "Do we have picture?", ""],
["Person_Of_Interest_s01e09_1_0.10.00.300-0.10.04.867.mp3", "And a GPS tracker.", ""],
["Person_Of_Interest_s01e09_1_0.10.03.269-0.10.06.369.mp3", "Nice work, Harold.", ""],
["Person_Of_Interest_s01e09_1_0.10.04.771-0.10.08.254.mp3", "We need eyes and ears on her 24-7,", ""],
["Person_Of_Interest_s01e09_1_0.10.06.656-0.10.09.939.mp3", "even inside the precinct.", ""],
["Person_Of_Interest_s01e09_1_0.10.15.014-0.10.21.167.mp3", "Finch, Carter's going right into Hector's shop.", ""],
["Person_Of_Interest_s01e09_1_0.10.19.569-0.10.23.786.mp3", "Primary suspect in the Ronnie Middleton shooting.", ""],
["Person_Of_Interest_s01e09_1_0.10.22.188-0.10.27.090.mp3", "How's the car business, Hector?", ""],
["Person_Of_Interest_s01e09_1_0.10.28.327-0.10.32.145.mp3", "You say that like you really care, detective.", ""],
["Person_Of_Interest_s01e09_1_0.10.30.547-0.10.33.813.mp3", "Care about where you were last night.", ""],
["Person_Of_Interest_s01e09_1_0.10.32.215-0.10.36.799.mp3", "Go ahead, spin that yarn, dazzle me.", ""],
["Person_Of_Interest_s01e09_1_0.10.35.201-0.10.39.602.mp3", "Sorry. I'm a domesticated man.", ""],
["Person_Of_Interest_s01e09_1_0.10.38.004-0.10.42.488.mp3", "I was back with my old lady, watching some show.", ""],
["Person_Of_Interest_s01e09_1_0.10.40.890-0.10.44.807.mp3", " Ask her. - of course.", ""],
["Person_Of_Interest_s01e09_1_0.10.43.209-0.10.48.161.mp3", "Always with the loyal alibi.", ""],
["Person_Of_Interest_s01e09_1_0.10.46.563-0.10.50.980.mp3", "You know, Monica, he's handsome, but you can do better.", ""],
["Person_Of_Interest_s01e09_1_0.10.49.382-0.10.53.499.mp3", "You got some huevos coming down here all alone, lady.", ""],
["Person_Of_Interest_s01e09_1_0.10.51.901-0.10.55.335.mp3", "So that wasn't your muscle car", ""],
["Person_Of_Interest_s01e09_1_0.10.53.737-0.10.57.370.mp3", "took a detour into Washington Heights last night?", ""],
["Person_Of_Interest_s01e09_1_0.10.55.772-0.10.59.822.mp3", "Nah, I hear it's dangerous down there.", ""],
["Person_Of_Interest_s01e09_1_0.10.58.224-0.11.01.457.mp3", "I know y'all heard", ""],
["Person_Of_Interest_s01e09_1_0.10.59.859-0.11.04.127.mp3", "what happened to Ronnie Middleton.", ""],
["Person_Of_Interest_s01e09_1_0.11.02.529-0.11.08.014.mp3", "I heard he ate a bullet that didn't agree with him.", ""],
["Person_Of_Interest_s01e09_1_0.11.06.416-0.11.12.501.mp3", "Nice shop, nice tools.", ""],
["Person_Of_Interest_s01e09_1_0.11.10.903-0.11.15.521.mp3", "Doing well for yourself, Hector.", ""],
["Person_Of_Interest_s01e09_1_0.11.13.923-0.11.17.640.mp3", "You make all this money fixing up old cars?", ""],
["Person_Of_Interest_s01e09_1_0.11.16.042-0.11.19.909.mp3", "I got a record. I got to work for myself.", ""],
["Person_Of_Interest_s01e09_1_0.11.18.311-0.11.21.944.mp3", "This is a nice ride. You mind if I check it out?", ""],
["Person_Of_Interest_s01e09_1_0.11.20.346-0.11.23.780.mp3", "Sure as hell do.", ""],
["Person_Of_Interest_s01e09_1_0.11.22.182-0.11.26.399.mp3", "You're gonna need a warrant for that.", ""],
["Person_Of_Interest_s01e09_1_0.11.27.085-0.11.31.788.mp3", "You messed up, taking that kid out, Hector.", ""],
["Person_Of_Interest_s01e09_1_0.11.30.190-0.11.34.040.mp3", "It's a shame what happened to that kid...", ""],
["Person_Of_Interest_s01e09_1_0.11.32.442-0.11.36.192.mp3", "Even if he was a punk-ass snitch.", ""],
["Person_Of_Interest_s01e09_1_0.11.34.594-0.11.38.861.mp3", "You won't get away with it again.", ""],
["Person_Of_Interest_s01e09_1_0.11.37.263-0.11.42.582.mp3", "I will find a way to bring you down.", ""],
["Person_Of_Interest_s01e09_1_0.11.40.984-0.11.46.803.mp3", "Good luck with that warrant, detective.", ""],
["Person_Of_Interest_s01e09_1_0.11.54.246-0.11.59.599.mp3", "Didn't know you collected dolls, Finch.", ""],
["Person_Of_Interest_s01e09_1_0.11.58.001-0.12.02.985.mp3", "As you know, I collect rare books, Mr. Reese.", ""],
["Person_Of_Interest_s01e09_1_0.12.01.387-0.12.04.604.mp3", "180-gram vinyl", ""],
["Person_Of_Interest_s01e09_1_0.12.03.006-0.12.08.891.mp3", "and a Xerox Alto when I can find one.", ""],
["Person_Of_Interest_s01e09_1_0.12.07.293-0.12.12.779.mp3", "This doll is for Detective Fusco.", ""],
["Person_Of_Interest_s01e09_1_0.12.11.181-0.12.14.614.mp3", "Fusco's into dolls?", ""],
["Person_Of_Interest_s01e09_1_0.12.13.016-0.12.17.900.mp3", "He is now, if we want to keep eyes on Detective Carter.", ""],
["Person_Of_Interest_s01e09_1_0.12.16.302-0.12.19.919.mp3", "I'll make sure it lands on his desk.", ""],
["Person_Of_Interest_s01e09_1_0.12.18.321-0.12.24.457.mp3", "I've been looking into our new number.", ""],
["Person_Of_Interest_s01e09_1_0.12.22.859-0.12.28.211.mp3", "Carter, detective first grade, homicide task force.", ""],
["Person_Of_Interest_s01e09_1_0.12.26.613-0.12.29.962.mp3", "Single mom, teenage son,", ""],
["Person_Of_Interest_s01e09_1_0.12.28.364-0.12.32.765.mp3", "served as an army interrogator.", ""],
["Person_Of_Interest_s01e09_1_0.12.31.167-0.12.33.916.mp3", "Passed the bar in '04,", ""],
["Person_Of_Interest_s01e09_1_0.12.32.318-0.12.35.468.mp3", "gave it up to go back on the force.", ""],
["Person_Of_Interest_s01e09_1_0.12.33.870-0.12.38.121.mp3", "- It's impressive, Mr. Reese. - Impressive lady.", ""],
["Person_Of_Interest_s01e09_1_0.12.36.523-0.12.39.388.mp3", "Honest to a fault.", ""],
["Person_Of_Interest_s01e09_1_0.12.37.790-0.12.41.357.mp3", "Which means she made a lot of enemies,", ""],
["Person_Of_Interest_s01e09_1_0.12.39.759-0.12.44.043.mp3", "both in the criminal world and in her own department.", ""],
["Person_Of_Interest_s01e09_1_0.12.42.445-0.12.45.761.mp3", "I've narrowed the list of possible suspects", ""],
["Person_Of_Interest_s01e09_1_0.12.44.163-0.12.50.032.mp3", "to a little over 300 or so.", ""],
["Person_Of_Interest_s01e09_1_0.12.48.434-0.12.51.868.mp3", "Day in the life of a homicide detective.", ""],
["Person_Of_Interest_s01e09_1_0.12.50.270-0.12.53.619.mp3", "Any more immediate threats?", ""],
["Person_Of_Interest_s01e09_1_0.12.54.356-0.12.58.724.mp3", "Hector Alvarez...", ""],
["Person_Of_Interest_s01e09_1_0.12.57.126-0.13.00.076.mp3", "Indicted for homicide", ""],
["Person_Of_Interest_s01e09_1_0.12.58.478-0.13.02.328.mp3", "on a case she worked six months ago...", ""],
["Person_Of_Interest_s01e09_1_0.13.00.730-0.13.03.713.mp3", "Till the charges were dropped.", ""],
["Person_Of_Interest_s01e09_1_0.13.02.115-0.13.07.416.mp3", "Edward Kovach-- Repeat felon, spouse abuser,", ""],
["Person_Of_Interest_s01e09_1_0.13.05.818-0.13.09.469.mp3", "whose wife she's taken a keen interest in protecting.", ""],
["Person_Of_Interest_s01e09_1_0.13.07.871-0.13.10.786.mp3", "And then there's Elias--", ""],
["Person_Of_Interest_s01e09_1_0.13.09.188-0.13.12.905.mp3", "Ruthless killer, organized crime boss,", ""],
["Person_Of_Interest_s01e09_1_0.13.11.307-0.13.15.057.mp3", "who's already taken a shot at her.", ""],
["Person_Of_Interest_s01e09_1_0.13.13.459-0.13.16.476.mp3", "Well, she's a walking target.", ""],
["Person_Of_Interest_s01e09_1_0.13.14.878-0.13.18.794.mp3", "Gonna have to keep her in sight at all times.", ""],
["Person_Of_Interest_s01e09_1_0.13.17.196-0.13.19.962.mp3", "You have to be careful.", ""],
["Person_Of_Interest_s01e09_1_0.13.18.364-0.13.21.764.mp3", "Get too close, you risk getting caught.", ""],
["Person_Of_Interest_s01e09_1_0.13.20.166-0.13.23.983.mp3", "That's a chance I got to take.", ""],
["Person_Of_Interest_s01e09_1_0.13.22.385-0.13.26.102.mp3", "What am I supposed to do, let her catch a bullet?", ""],
["Person_Of_Interest_s01e09_1_0.13.24.504-0.13.27.653.mp3", "What will you do if she catches you?", ""],
["Person_Of_Interest_s01e09_1_0.13.26.055-0.13.31.640.mp3", "Well, I'm sure you'll figure something out, Harold.", ""],
["Person_Of_Interest_s01e09_1_0.13.43.906-0.13.46.839.mp3", "What the hell?", ""],
["Person_Of_Interest_s01e09_1_0.13.50.862-0.13.54.130.mp3", "Detective Fusco.", ""],
["Person_Of_Interest_s01e09_1_0.13.52.532-0.13.56.265.mp3", "Happy birthday, Lionel.", ""],
["Person_Of_Interest_s01e09_1_0.13.54.667-0.13.59.051.mp3", "Thanks, but no thanks. It's not my birthday.", ""],
["Person_Of_Interest_s01e09_1_0.13.57.453-0.14.01.187.mp3", "I don't know what the hell you're trying to tell me here.", ""],
["Person_Of_Interest_s01e09_1_0.13.59.589-0.14.03.806.mp3", "Just putt on your desk and face it towards Carter.", ""],
["Person_Of_Interest_s01e09_1_0.14.02.208-0.14.05.174.mp3", "Why?", ""],
["Person_Of_Interest_s01e09_1_0.14.03.576-0.14.06.508.mp3", "'Cause there's a camera inside,", ""],
["Person_Of_Interest_s01e09_1_0.14.04.910-0.14.08.945.mp3", "and we need to know everyone she's talking to.", ""],
["Person_Of_Interest_s01e09_1_0.14.08.630-0.14.13.449.mp3", "You know something I don't?", ""],
["Person_Of_Interest_s01e09_1_0.14.11.851-0.14.16.652.mp3", "- She in trouble? - Well, you tell me.", ""],
["Person_Of_Interest_s01e09_1_0.14.15.054-0.14.18.621.mp3", "Ask around with some of your corrupt pals", ""],
["Person_Of_Interest_s01e09_1_0.14.17.023-0.14.19.872.mp3", "inside the force.", ""],
["Person_Of_Interest_s01e09_1_0.14.18.274-0.14.21.908.mp3", "Hey, what's going on? What do you need?", ""],
["Person_Of_Interest_s01e09_1_0.14.20.310-0.14.23.743.mp3", "I need to find out who might want", ""],
["Person_Of_Interest_s01e09_1_0.14.22.145-0.14.25.011.mp3", "- to take Carter out. - Whoa, wait a minute.", ""],
["Person_Of_Interest_s01e09_1_0.14.23.413-0.14.26.796.mp3", "I can't be involved in something like that.", ""],
["Person_Of_Interest_s01e09_1_0.14.25.198-0.14.29.999.mp3", "No, Lionel, just turn the camera towards her desk.", ""],
["Person_Of_Interest_s01e09_1_0.14.30.452-0.14.35.137.mp3", "Nice doll.", ""],
["Person_Of_Interest_s01e09_1_0.14.33.539-0.14.39.425.mp3", "Yeah, my, uh-- My son gave it to me.", ""],
["Person_Of_Interest_s01e09_1_0.14.37.827-0.14.41.510.mp3", "How'd it go with the old Don at the big house?", ""],
["Person_Of_Interest_s01e09_1_0.14.39.912-0.14.42.762.mp3", "Tried to reach out,", ""],
["Person_Of_Interest_s01e09_1_0.14.41.164-0.14.45.097.mp3", "see what he knew about his biological son.", ""],
["Person_Of_Interest_s01e09_1_0.14.43.499-0.14.48.651.mp3", "- Elias, huh? - Old man just shut me down.", ""],
["Person_Of_Interest_s01e09_1_0.14.47.053-0.14.50.937.mp3", "Seems to think every cop is dirty.", ""],
["Person_Of_Interest_s01e09_1_0.14.49.339-0.14.53.439.mp3", "Yeah.", ""],
["Person_Of_Interest_s01e09_1_0.14.51.841-0.14.55.107.mp3", "Maybe back in his day.", ""],
["Person_Of_Interest_s01e09_1_0.14.53.509-0.14.57.443.mp3", "That bodega owner Castillo come in yet?", ""],
["Person_Of_Interest_s01e09_1_0.14.55.845-0.14.59.278.mp3", " Not that I know of. - Huh.", ""],
["Person_Of_Interest_s01e09_1_0.14.57.680-0.15.02.081.mp3", "Gonna have to pay him another visit.", ""],
["Person_Of_Interest_s01e09_1_0.15.00.483-0.15.03.532.mp3", "You coming?", ""],
["Person_Of_Interest_s01e09_1_0.15.01.934-0.15.04.834.mp3", "Nah, you know what?", ""],
["Person_Of_Interest_s01e09_1_0.15.03.236-0.15.06.752.mp3", "Why don't you, uh, go ahead? I-I got a thing.", ""],
["Person_Of_Interest_s01e09_1_0.15.05.154-0.15.08.404.mp3", "I'll catch up with you later, okay?", ""],
["Person_Of_Interest_s01e09_1_0.15.06.806-0.15.10.373.mp3", "Okay.", ""],
["Person_Of_Interest_s01e09_1_0.15.21.504-0.15.24.904.mp3", "Whoa, whoa, whoa!", ""],
["Person_Of_Interest_s01e09_1_0.15.23.306-0.15.26.439.mp3", "- Come here. - Yo, I ain't done nothing.", ""],
["Person_Of_Interest_s01e09_1_0.15.24.841-0.15.28.441.mp3", "- Hands where I can see 'em. - Get off.", ""],
["Person_Of_Interest_s01e09_1_0.15.26.843-0.15.30.592.mp3", "Got any needles? Anything that's gonna stick me?", ""],
["Person_Of_Interest_s01e09_1_0.15.28.994-0.15.32.761.mp3", "This is violation of my civil liberties.", ""],
["Person_Of_Interest_s01e09_1_0.15.31.163-0.15.34.280.mp3", "Finch, I don't like the looks of this.", ""],
["Person_Of_Interest_s01e09_1_0.15.32.682-0.15.35.531.mp3", "Aah!", ""],
["Person_Of_Interest_s01e09_1_0.15.33.933-0.15.37.566.mp3", "Bitch, you better get your hands off me.", ""],
["Person_Of_Interest_s01e09_1_0.15.35.968-0.15.40.786.mp3", "Shut up and get your head down.", ""],
["Person_Of_Interest_s01e09_1_0.15.39.188-0.15.44.323.mp3", "Yo, thanks for making it look good, detective.", ""],
["Person_Of_Interest_s01e09_1_0.15.42.725-0.15.45.992.mp3", "I think I tweaked my wrist, man.", ""],
["Person_Of_Interest_s01e09_1_0.15.44.394-0.15.48.494.mp3", "That was a little too theatrical, Bottlecap.", ""],
["Person_Of_Interest_s01e09_1_0.15.46.896-0.15.49.762.mp3", "- Hey-- - Wait a minute, Reese.", ""],
["Person_Of_Interest_s01e09_1_0.15.48.164-0.15.50.963.mp3", "I think she knows him.", ""],
["Person_Of_Interest_s01e09_1_0.15.49.365-0.15.52.465.mp3", "It's all for show.", ""],
["Person_Of_Interest_s01e09_1_0.15.50.867-0.15.54.700.mp3", "Must be one of her CIS.", ""],
["Person_Of_Interest_s01e09_1_0.15.53.102-0.15.56.752.mp3", "That's 'cause after I last got popped,", ""],
["Person_Of_Interest_s01e09_1_0.15.55.154-0.15.59.138.mp3", "I used my time to rehabilitate myself.", ""],
["Person_Of_Interest_s01e09_1_0.15.57.540-0.16.00.339.mp3", "You got clean?", ""],
["Person_Of_Interest_s01e09_1_0.15.58.741-0.16.02.425.mp3", "- Come on now, BC. - I'm serious.", ""],
["Person_Of_Interest_s01e09_1_0.16.00.827-0.16.04.226.mp3", "These pipes are junk-free.", ""],
["Person_Of_Interest_s01e09_1_0.16.02.628-0.16.06.145.mp3", "But I can always use some scratch,", ""],
["Person_Of_Interest_s01e09_1_0.16.04.547-0.16.07.229.mp3", "you know what I'm saying?", ""],
["Person_Of_Interest_s01e09_1_0.16.05.631-0.16.09.148.mp3", "I need to know what you've heard", ""],
["Person_Of_Interest_s01e09_1_0.16.07.550-0.16.12.935.mp3", "about the new guy Elias.", ""],
["Person_Of_Interest_s01e09_1_0.16.11.337-0.16.16.638.mp3", "Yeah, I've been hearing that name up and coming a lot.", ""],
["Person_Of_Interest_s01e09_1_0.16.15.040-0.16.17.940.mp3", "I never seen him,", ""],
["Person_Of_Interest_s01e09_1_0.16.16.342-0.16.21.994.mp3", "but I-I hear he's a man not to be trifled with.", ""],
["Person_Of_Interest_s01e09_1_0.16.20.396-0.16.25.031.mp3", "You, um, know anything about that shooting last night", ""],
["Person_Of_Interest_s01e09_1_0.16.23.433-0.16.26.699.mp3", "over on 168th and Audubon?", ""],
["Person_Of_Interest_s01e09_1_0.16.25.101-0.16.28.584.mp3", "Drive-by, right?", ""],
["Person_Of_Interest_s01e09_1_0.16.26.986-0.16.30.819.mp3", "I know the block, just not the players.", ""],
["Person_Of_Interest_s01e09_1_0.16.29.221-0.16.33.039.mp3", "You ever hear the name Hector Alvarez come up", ""],
["Person_Of_Interest_s01e09_1_0.16.31.441-0.16.35.841.mp3", "or see him cruise the block in his GTO?", ""],
["Person_Of_Interest_s01e09_1_0.16.34.243-0.16.39.828.mp3", "I didn't see the car or hear nobody talk about Hector,", ""],
["Person_Of_Interest_s01e09_1_0.16.38.230-0.16.41.881.mp3", "but I can ask around.", ""],
["Person_Of_Interest_s01e09_1_0.16.40.283-0.16.43.966.mp3", "Good looking out, BC.", ""],
["Person_Of_Interest_s01e09_1_0.16.42.368-0.16.48.003.mp3", "If you get anything back on, um, Hector or Elias,", ""],
["Person_Of_Interest_s01e09_1_0.16.46.405-0.16.51.524.mp3", "there's more where that came from.", ""],
["Person_Of_Interest_s01e09_1_0.16.57.883-0.17.00.950.mp3", "Hey, captain.", ""],
["Person_Of_Interest_s01e09_1_0.16.59.352-0.17.02.851.mp3", "Welcome back, detective.", ""],
["Person_Of_Interest_s01e09_1_0.17.01.253-0.17.05.687.mp3", "Didn't think you'd grace us with your presence again", ""],
["Person_Of_Interest_s01e09_1_0.17.04.089-0.17.08.791.mp3", "once you spent time with the perfumed folk downtown.", ""],
["Person_Of_Interest_s01e09_1_0.17.08.361-0.17.11.744.mp3", "How'd a half-wit like you pull that off?", ""],
["Person_Of_Interest_s01e09_1_0.17.10.146-0.17.14.080.mp3", "I guess the half's still got some juice, huh, captain?", ""],
["Person_Of_Interest_s01e09_1_0.17.13.766-0.17.17.366.mp3", "They got me working with Detective Carter,", ""],
["Person_Of_Interest_s01e09_1_0.17.15.768-0.17.18.884.mp3", "and, uh...", ""],
["Person_Of_Interest_s01e09_1_0.17.17.286-0.17.20.636.mp3", "I'm starting to hear some things.", ""],
["Person_Of_Interest_s01e09_1_0.17.19.038-0.17.23.055.mp3", "Yeah? Like what?", ""],
["Person_Of_Interest_s01e09_1_0.17.21.457-0.17.24.807.mp3", "Maybe she's not so well-liked", ""],
["Person_Of_Interest_s01e09_1_0.17.23.209-0.17.27.977.mp3", "by, uh, a certain element.", ""],
["Person_Of_Interest_s01e09_1_0.17.26.379-0.17.30.896.mp3", "Listen, Lionel...", ""],
["Person_Of_Interest_s01e09_1_0.17.29.298-0.17.32.815.mp3", "Things are going back to the way they used to be.", ""],
["Person_Of_Interest_s01e09_1_0.17.31.217-0.17.34.266.mp3", "Used to be?", ""],
["Person_Of_Interest_s01e09_1_0.17.32.668-0.17.36.736.mp3", "Thing about organized crime? It was organized.", ""],
["Person_Of_Interest_s01e09_1_0.17.35.138-0.17.39.855.mp3", "Things worked. Trains ran on time.", ""],
["Person_Of_Interest_s01e09_1_0.17.38.257-0.17.42.658.mp3", "This new guy...", ""],
["Person_Of_Interest_s01e09_1_0.17.41.060-0.17.43.943.mp3", "He knows the rules.", ""],
["Person_Of_Interest_s01e09_1_0.17.42.345-0.17.46.612.mp3", "New guy-- You mean Elias.", ""],
["Person_Of_Interest_s01e09_1_0.17.45.014-0.17.48.998.mp3", "Runs a tight ship...", ""],
["Person_Of_Interest_s01e09_1_0.17.47.400-0.17.50.416.mp3", "Low profile.", ""],
["Person_Of_Interest_s01e09_1_0.17.48.818-0.17.52.701.mp3", "Not like these cutthroat Russian idiots.", ""],
["Person_Of_Interest_s01e09_1_0.17.51.103-0.17.54.403.mp3", "He knows who to grease...", ""],
["Person_Of_Interest_s01e09_1_0.17.52.805-0.17.56.738.mp3", "All the way up to city hall.", ""],
["Person_Of_Interest_s01e09_1_0.17.55.140-0.17.59.008.mp3", "Look, the economy's in the toilet.", ""],
["Person_Of_Interest_s01e09_1_0.17.57.410-0.18.02.211.mp3", "Detective Carter doesn't understand the rules.", ""],
["Person_Of_Interest_s01e09_1_0.18.00.613-0.18.05.231.mp3", "She's bad for business.", ""],
["Person_Of_Interest_s01e09_1_0.18.03.633-0.18.07.299.mp3", "- What'd she do? - Sniffing around...", ""],
["Person_Of_Interest_s01e09_1_0.18.05.701-0.18.09.101.mp3", "Trying to build a case.", ""],
["Person_Of_Interest_s01e09_1_0.18.07.503-0.18.12.638.mp3", "She's gunning for Elias. She's got to go.", ""],
["Person_Of_Interest_s01e09_1_0.18.12.507-0.18.15.858.mp3", "It's a tricky business, getting rid of a cop.", ""],
["Person_Of_Interest_s01e09_1_0.18.14.260-0.18.18.861.mp3", "Went through the proper back channels...", ""],
["Person_Of_Interest_s01e09_1_0.18.17.263-0.18.21.397.mp3", "Up the chain of command.", ""],
["Person_Of_Interest_s01e09_1_0.18.19.799-0.18.22.815.mp3", "Permission granted.", ""],
["Person_Of_Interest_s01e09_1_0.18.21.217-0.18.24.700.mp3", "It's just got to look...", ""],
["Person_Of_Interest_s01e09_1_0.18.23.102-0.18.25.985.mp3", "Clean.", ""],
["Person_Of_Interest_s01e09_1_0.18.24.387-0.18.27.703.mp3", "Clean?", ""],
["Person_Of_Interest_s01e09_1_0.18.26.105-0.18.31.106.mp3", "You mean like in the line of duty?", ""],
["Person_Of_Interest_s01e09_1_0.18.29.508-0.18.34.710.mp3", "I'm starting to feel caught in the middle here, captain.", ""],
["Person_Of_Interest_s01e09_1_0.18.33.112-0.18.37.546.mp3", "I'd keep my distance, if I were you.", ""],
["Person_Of_Interest_s01e09_1_0.18.46.024-0.18.50.326.mp3", "You didn't come down to the precinct", ""],
["Person_Of_Interest_s01e09_1_0.18.48.728-0.18.53.095.mp3", "like you told me you would, Mr. Castillo.", ""],
["Person_Of_Interest_s01e09_1_0.18.51.497-0.18.55.797.mp3", "I got no help today. I'm a very busy man.", ""],
["Person_Of_Interest_s01e09_1_0.18.54.199-0.18.58.350.mp3", "Did you see this car before or after the shooting?", ""],
["Person_Of_Interest_s01e09_1_0.18.56.752-0.19.01.520.mp3", "You didn't tell me that the guy that they killed", ""],
["Person_Of_Interest_s01e09_1_0.18.59.922-0.19.03.472.mp3", "was a witness to another shooting.", ""],
["Person_Of_Interest_s01e09_1_0.19.01.874-0.19.06.192.mp3", "He decided not to testify. Didn't save him.", ""],
["Person_Of_Interest_s01e09_1_0.19.04.594-0.19.08.160.mp3", "If you think that's gonna convince me to,", ""],
["Person_Of_Interest_s01e09_1_0.19.06.562-0.19.09.829.mp3", "- it's not helping. - The point is...", ""],
["Person_Of_Interest_s01e09_1_0.19.08.231-0.19.13.699.mp3", "If Hector Alvarez thinks you saw him shoot someone,", ""],
["Person_Of_Interest_s01e09_1_0.19.12.101-0.19.15.835.mp3", "he's gonna come after you too.", ""],
["Person_Of_Interest_s01e09_1_0.19.14.237-0.19.19.038.mp3", "Please. Look, I have a family.", ""],
["Person_Of_Interest_s01e09_1_0.19.17.440-0.19.20.372.mp3", "Exactly.", ""],
["Person_Of_Interest_s01e09_1_0.19.18.774-0.19.22.174.mp3", "If you help me,", ""],
["Person_Of_Interest_s01e09_1_0.19.20.576-0.19.24.426.mp3", "I can protect you and your family.", ""],
["Person_Of_Interest_s01e09_1_0.19.22.828-0.19.26.962.mp3", "If you don't...", ""],
["Person_Of_Interest_s01e09_1_0.19.25.364-0.19.30.499.mp3", "He could still come after you.", ""],
["Person_Of_Interest_s01e09_1_0.19.28.901-0.19.32.434.mp3", "What's the word, Lionel?", ""],
["Person_Of_Interest_s01e09_1_0.19.30.836-0.19.35.054.mp3", "I did some checking around.", ""],
["Person_Of_Interest_s01e09_1_0.19.33.456-0.19.38.057.mp3", "Carter's name came up and not in a good way.", ""],
["Person_Of_Interest_s01e09_1_0.19.36.459-0.19.40.008.mp3", "Elias wants her gone... Today.", ""],
["Person_Of_Interest_s01e09_1_0.19.38.410-0.19.42.061.mp3", "Killing a cop brings a lot of heat.", ""],
["Person_Of_Interest_s01e09_1_0.19.40.463-0.19.44.230.mp3", "Yeah, which is why they're gonna make it look clean.", ""],
["Person_Of_Interest_s01e09_1_0.19.42.632-0.19.45.981.mp3", "He could set up a patsy or pay someone off", ""],
["Person_Of_Interest_s01e09_1_0.19.44.383-0.19.48.067.mp3", "on a case she's working.", ""],
["Person_Of_Interest_s01e09_1_0.19.46.469-0.19.50.286.mp3", "All I know is, every door that Carter walks through", ""],
["Person_Of_Interest_s01e09_1_0.19.48.688-0.19.51.737.mp3", "could have a bullet behind it.", ""],
["Person_Of_Interest_s01e09_1_0.19.50.139-0.19.56.375.mp3", "Did you see this guy in your store last night?", ""],
["Person_Of_Interest_s01e09_1_0.19.54.777-0.19.59.828.mp3", "Please. That's all I need.", ""],
["Person_Of_Interest_s01e09_1_0.20.02.734-0.20.05.701.mp3", "I saw him earlier.", ""],
["Person_Of_Interest_s01e09_1_0.20.04.103-0.20.10.339.mp3", "He's been in my store before, to buy condoms, beer.", ""],
["Person_Of_Interest_s01e09_1_0.20.08.741-0.20.11.590.mp3", "What does it mater?", ""],
["Person_Of_Interest_s01e09_1_0.20.09.992-0.20.13.309.mp3", "I'm not gonna give you a statement anyways.", ""],
["Person_Of_Interest_s01e09_1_0.20.11.711-0.20.16.178.mp3", " Can You Please Leave my store? - Okay.", ""],
["Person_Of_Interest_s01e09_1_0.20.14.580-0.20.19.431.mp3", "Okay. Thank you.", ""],
["Person_Of_Interest_s01e09_1_0.20.23.756-0.20.27.773.mp3", "Oh, sorry, detective.", ""],
["Person_Of_Interest_s01e09_1_0.20.26.175-0.20.30.359.mp3", "I didn't realize that was you from behind.", ""],
["Person_Of_Interest_s01e09_1_0.20.28.761-0.20.32.494.mp3", "Lot of fine girls out today.", ""],
["Person_Of_Interest_s01e09_1_0.20.30.896-0.20.34.163.mp3", "Keep it moving, lover boy.", ""],
["Person_Of_Interest_s01e09_1_0.20.32.565-0.20.35.948.mp3", "You got to be careful on this block.", ""],
["Person_Of_Interest_s01e09_1_0.20.34.350-0.20.39.368.mp3", "I heard some kid got popped last night.", ""],
["Person_Of_Interest_s01e09_1_0.20.37.770-0.20.42.288.mp3", "You got any kids, detective?", ""],
["Person_Of_Interest_s01e09_1_0.20.42.774-0.20.45.574.mp3", "Stay off this block.", ""],
["Person_Of_Interest_s01e09_1_0.20.43.976-0.20.48.344.mp3", "I see this car roll by one more time,", ""],
["Person_Of_Interest_s01e09_1_0.20.46.746-0.20.49.595.mp3", "I'm gonna impound it.", ""],
["Person_Of_Interest_s01e09_1_0.20.47.997-0.20.52.214.mp3", "I'll be seeing you around, Mr. Castillo.", ""],
["Person_Of_Interest_s01e09_1_0.20.54.036-0.20.58.304.mp3", "Get out of here.", ""],
["Person_Of_Interest_s01e09_1_0.20.56.706-0.21.00.356.mp3", "Let's go.", ""],
["Person_Of_Interest_s01e09_1_0.21.08.487-0.21.11.671.mp3", "Elias wants Carter gone.", ""],
["Person_Of_Interest_s01e09_1_0.21.10.073-0.21.14.374.mp3", "Possible he'll use someone with motive...", ""],
["Person_Of_Interest_s01e09_1_0.21.12.776-0.21.17.577.mp3", "The suspect in one of her cases.", ""],
["Person_Of_Interest_s01e09_1_0.21.18.614-0.21.21.531.mp3", "Carter's at a bar.", ""],
["Person_Of_Interest_s01e09_1_0.21.19.933-0.21.23.383.mp3", "I thought she was on duty.", ""],
["Person_Of_Interest_s01e09_1_0.21.21.785-0.21.25.718.mp3", "With this many people after her,", ""],
["Person_Of_Interest_s01e09_1_0.21.24.120-0.21.28.304.mp3", "I'd be inclined to pick up the tab.", ""],
["Person_Of_Interest_s01e09_1_0.21.30.008-0.21.34.360.mp3", "Tell me, Eddie...", ""],
["Person_Of_Interest_s01e09_1_0.21.32.762-0.21.37.196.mp3", "What kind of degenerate does that to his wife?", ""],
["Person_Of_Interest_s01e09_1_0.21.35.598-0.21.39.365.mp3", "Carter's paying Kovach a visit.", ""],
["Person_Of_Interest_s01e09_1_0.21.37.767-0.21.42.902.mp3", "Why is a homicide detective intervening in a domestic case?", ""],
["Person_Of_Interest_s01e09_1_0.21.41.304-0.21.44.520.mp3", "Maybe she's like us.", ""],
["Person_Of_Interest_s01e09_1_0.21.42.922-0.21.47.156.mp3", "Trying to prevent something bad from happening.", ""],
["Person_Of_Interest_s01e09_1_0.21.48.277-0.21.52.712.mp3", "What happens between a man and his woman behind closed doors", ""],
["Person_Of_Interest_s01e09_1_0.21.51.114-0.21.54.547.mp3", "is none of your damn business.", ""],
["Person_Of_Interest_s01e09_1_0.21.52.949-0.21.56.549.mp3", "Can't stop you from boozing your life away.", ""],
["Person_Of_Interest_s01e09_1_0.21.54.951-0.21.59.669.mp3", "But you go home and put your hands on your wife again,", ""],
["Person_Of_Interest_s01e09_1_0.21.58.071-0.22.00.920.mp3", "I'm coming after you.", ""],
["Person_Of_Interest_s01e09_1_0.21.59.322-0.22.02.722.mp3", "You come after me,", ""],
["Person_Of_Interest_s01e09_1_0.22.01.124-0.22.06.759.mp3", "and I will exercise my second amendment rights.", ""],
["Person_Of_Interest_s01e09_1_0.22.05.161-0.22.11.097.mp3", "And I promise you, I got a pretty big gun.", ""],
["Person_Of_Interest_s01e09_1_0.22.09.499-0.22.14.901.mp3", "Man as angry and bitter as you are...", ""],
["Person_Of_Interest_s01e09_1_0.22.14.920-0.22.21.324.mp3", "I got a feeling it ain't that big, Eddie.", ""],
["Person_Of_Interest_s01e09_1_0.22.22.394-0.22.27.663.mp3", "I got to admit, Finch, I sure like her style.", ""],
["Person_Of_Interest_s01e09_1_0.22.26.065-0.22.31.784.mp3", "I think we got a new front-runner.", ""],
["Person_Of_Interest_s01e09_1_0.22.33.972-0.22.38.291.mp3", "Mark Thomson,", ""],
["Person_Of_Interest_s01e09_1_0.22.36.693-0.22.40.409.mp3", "Ricky Lopez,", ""],
["Person_Of_Interest_s01e09_1_0.22.38.811-0.22.42.512.mp3", "Joseph McNally...", ""],
["Person_Of_Interest_s01e09_1_0.22.40.914-0.22.46.215.mp3", "All were killed from a suicide vest", ""],
["Person_Of_Interest_s01e09_1_0.22.44.617-0.22.48.718.mp3", "you helped transport.", ""],
["Person_Of_Interest_s01e09_1_0.22.47.120-0.22.51.471.mp3", "They had families...", ""],
["Person_Of_Interest_s01e09_1_0.22.49.873-0.22.53.823.mp3", "People that loved them.", ""],
["Person_Of_Interest_s01e09_1_0.22.52.225-0.22.56.692.mp3", "I'm sorry for the soldiers,", ""],
["Person_Of_Interest_s01e09_1_0.22.55.094-0.22.58.661.mp3", "but I deliver vegetables.", ""],
["Person_Of_Interest_s01e09_1_0.22.57.063-0.23.03.332.mp3", "I know you're working with Al-Qaeda, Yusuf...", ""],
["Person_Of_Interest_s01e09_1_0.23.01.734-0.23.04.934.mp3", "'Cause I have photos here", ""],
["Person_Of_Interest_s01e09_1_0.23.03.336-0.23.07.937.mp3", "of you loading vests into your truck.", ""],
["Person_Of_Interest_s01e09_1_0.23.06.339-0.23.10.239.mp3", "Now, you want to tell me", ""],
["Person_Of_Interest_s01e09_1_0.23.08.641-0.23.12.992.mp3", "all these photos of you are fake?", ""],
["Person_Of_Interest_s01e09_1_0.23.11.394-0.23.14.377.mp3", "Hmm?", ""],
["Person_Of_Interest_s01e09_1_0.23.12.779-0.23.18.714.mp3", "Show me where the other suicide vests are hidden, Yusuf.", ""],
["Person_Of_Interest_s01e09_1_0.23.17.116-0.23.20.466.mp3", "Point to the location.", ""],
["Person_Of_Interest_s01e09_1_0.23.23.688-0.23.28.090.mp3", "Do you know what they will do", ""],
["Person_Of_Interest_s01e09_1_0.23.26.492-0.23.31.511.mp3", "if they find out that I helped you?", ""],
["Person_Of_Interest_s01e09_1_0.23.29.913-0.23.34.180.mp3", "They will kill my wife.", ""],
["Person_Of_Interest_s01e09_1_0.23.32.582-0.23.36.916.mp3", "They will kill my son.", ""],
["Person_Of_Interest_s01e09_1_0.23.35.318-0.23.39.819.mp3", "I would rather you just kill me now.", ""],
["Person_Of_Interest_s01e09_1_0.23.53.685-0.23.57.270.mp3", "Carter, is that the DOA's phone--", ""],
["Person_Of_Interest_s01e09_1_0.23.55.672-0.23.58.504.mp3", "Ronnie Middleton?", ""],
["Person_Of_Interest_s01e09_1_0.23.56.906-0.24.01.173.mp3", "His mother hasn't even come to the morgue.", ""],
["Person_Of_Interest_s01e09_1_0.23.59.575-0.24.02.708.mp3", "This kid was all alone.", ""],
["Person_Of_Interest_s01e09_1_0.24.01.110-0.24.04.544.mp3", "He deserved better.", ""],
["Person_Of_Interest_s01e09_1_0.24.02.946-0.24.07.547.mp3", "So far, I've got nothing on Hector.", ""],
["Person_Of_Interest_s01e09_1_0.24.05.949-0.24.09.382.mp3", "Analyst from the real-time crime center", ""],
["Person_Of_Interest_s01e09_1_0.24.07.784-0.24.11.333.mp3", "sent over footage from some of the cameras", ""],
["Person_Of_Interest_s01e09_1_0.24.09.735-0.24.12.385.mp3", "around Bodega La Nueva.", ""],
["Person_Of_Interest_s01e09_1_0.24.10.787-0.24.13.352.mp3", "Some?", ""],
["Person_Of_Interest_s01e09_1_0.24.11.754-0.24.14.971.mp3", "There's more cameras than this?", ""],
["Person_Of_Interest_s01e09_1_0.24.13.373-0.24.16.672.mp3", "Yeah. Mayor wants one on every corner.", ""],
["Person_Of_Interest_s01e09_1_0.24.15.074-0.24.18.724.mp3", "Wow, no wonder I feel like I'm always being watched.", ""],
["Person_Of_Interest_s01e09_1_0.24.17.126-0.24.21.527.mp3", "I figured Hector's GTO had to pass", ""],
["Person_Of_Interest_s01e09_1_0.24.19.929-0.24.23.813.mp3", "through this intersection, but nothing, nada.", ""],
["Person_Of_Interest_s01e09_1_0.24.22.215-0.24.25.615.mp3", "Maybe he didn't drive. Maybe he walked.", ""],
["Person_Of_Interest_s01e09_1_0.24.24.017-0.24.29.685.mp3", "Castillo said he came into his market a couple times", ""],
["Person_Of_Interest_s01e09_1_0.24.28.087-0.24.32.371.mp3", "to purchase some booze and trojans.", ""],
["Person_Of_Interest_s01e09_1_0.24.30.773-0.24.33.489.mp3", "So?", ""],
["Person_Of_Interest_s01e09_1_0.24.31.891-0.24.35.157.mp3", "His girlfriend lives in the Bronx too.", ""],
["Person_Of_Interest_s01e09_1_0.24.33.559-0.24.38.527.mp3", "Why would he have to go 25 blocks downtown for condoms?", ""],
["Person_Of_Interest_s01e09_1_0.24.36.929-0.24.42.214.mp3", "'Cause Don Juan got a little chicky on the side.", ""],
["Person_Of_Interest_s01e09_1_0.24.40.616-0.24.44.050.mp3", "Hmm.", ""],
["Person_Of_Interest_s01e09_1_0.24.42.452-0.24.46.002.mp3", "Hector was on foot.", ""],
["Person_Of_Interest_s01e09_1_0.24.44.404-0.24.49.005.mp3", "Maybe he walked from her apartment to the market.", ""],
["Person_Of_Interest_s01e09_1_0.24.47.407-0.24.50.923.mp3", "And that's where Hector bumped into Ronnie.", ""],
["Person_Of_Interest_s01e09_1_0.24.49.325-0.24.52.308.mp3", "If we can find this chica,", ""],
["Person_Of_Interest_s01e09_1_0.24.50.710-0.24.53.976.mp3", "we might have ourselves a new witness.", ""],
["Person_Of_Interest_s01e09_1_0.24.52.378-0.24.55.428.mp3", "I'm gonna make some phone calls.", ""],
["Person_Of_Interest_s01e09_1_0.24.53.830-0.24.56.378.mp3", "Look, I got to go.", ""],
["Person_Of_Interest_s01e09_1_0.24.54.780-0.24.57.396.mp3", "You can thank me later, all right?", ""],
["Person_Of_Interest_s01e09_1_0.24.57.050-0.25.00.399.mp3", "Hello. What, do you miss me already?", ""],
["Person_Of_Interest_s01e09_1_0.24.58.801-0.25.02.068.mp3", "You're a hard man to miss, Lionel.", ""],
["Person_Of_Interest_s01e09_1_0.25.00.470-0.25.04.186.mp3", "I'd say this Carter situation's got you worried.", ""],
["Person_Of_Interest_s01e09_1_0.25.02.588-0.25.06.739.mp3", "What are you gonna do, follow her around from now on?", ""],
["Person_Of_Interest_s01e09_1_0.25.05.141-0.25.08.774.mp3", "I'm not. You are.", ""],
["Person_Of_Interest_s01e09_1_0.25.07.176-0.25.11.661.mp3", "I've got some business to take care of.", ""],
["Person_Of_Interest_s01e09_1_0.25.10.063-0.25.13.746.mp3", "Don't let her get in any trouble.", ""],
["Person_Of_Interest_s01e09_1_0.25.12.148-0.25.14.780.mp3", "Carter's gunning for you.", ""],
["Person_Of_Interest_s01e09_1_0.25.13.182-0.25.16.332.mp3", "Hell, she's probably gonna catch you.", ""],
["Person_Of_Interest_s01e09_1_0.25.14.734-0.25.18.701.mp3", "Why you spending so much time trying to protect her?", ""],
["Person_Of_Interest_s01e09_1_0.25.17.103-0.25.20.753.mp3", "She's a good cop...", ""],
["Person_Of_Interest_s01e09_1_0.25.19.155-0.25.22.872.mp3", "Good person.", ""],
["Person_Of_Interest_s01e09_1_0.25.21.274-0.25.25.174.mp3", "Hell, you should try it sometime, Lionel.", ""],
["Person_Of_Interest_s01e09_1_0.25.23.576-0.25.26.742.mp3", "Yeah, thanks, look, I'm just saying,", ""],
["Person_Of_Interest_s01e09_1_0.25.25.144-0.25.28.461.mp3", "if she wasn't around, it would probably solve", ""],
["Person_Of_Interest_s01e09_1_0.25.26.863-0.25.30.329.mp3", "a lot of your problems, now, wouldn't it?", ""],
["Person_Of_Interest_s01e09_1_0.25.28.731-0.25.32.247.mp3", "If anything happens to her, Lionel,", ""],
["Person_Of_Interest_s01e09_1_0.25.30.649-0.25.33.933.mp3", "I'm coming for you next.", ""],
["Person_Of_Interest_s01e09_1_0.25.41.109-0.25.44.026.mp3", "What the--", ""],
["Person_Of_Interest_s01e09_1_0.25.54.606-0.25.58.541.mp3", "Knock, knock.", ""],
["Person_Of_Interest_s01e09_1_0.25.56.943-0.25.59.992.mp3", "What do we have here?", ""],
["Person_Of_Interest_s01e09_1_0.25.58.394-0.26.03.713.mp3", "Hector's a busy man-- Fixing cars and running guns.", ""],
["Person_Of_Interest_s01e09_1_0.26.02.115-0.26.06.749.mp3", "Who are you, man?", ""],
["Person_Of_Interest_s01e09_1_0.26.05.151-0.26.09.635.mp3", "Tell Hector I'm the guy that just put him out of business.", ""],
["Person_Of_Interest_s01e09_1_0.26.11.406-0.26.16.308.mp3", "If I see him again, I'll close down more than the shop.", ""],
["Person_Of_Interest_s01e09_1_0.26.32.912-0.26.36.028.mp3", "If you help us,", ""],
["Person_Of_Interest_s01e09_1_0.26.34.430-0.26.39.365.mp3", "I can protect you and your family.", ""],
["Person_Of_Interest_s01e09_1_0.26.37.767-0.26.42.268.mp3", "I promise.", ""],
["Person_Of_Interest_s01e09_1_0.26.40.670-0.26.45.721.mp3", "This is just a negotiation for you.", ""],
["Person_Of_Interest_s01e09_1_0.26.44.123-0.26.48.774.mp3", "You don't care about me or my family.", ""],
["Person_Of_Interest_s01e09_1_0.26.47.176-0.26.53.479.mp3", "Your son-- He's named after you.", ""],
["Person_Of_Interest_s01e09_1_0.26.51.881-0.26.55.314.mp3", "He's turning 8 in 14 days, right?", ""],
["Person_Of_Interest_s01e09_1_0.26.53.716-0.26.58.367.mp3", "Favorite sport? Soccer.", ""],
["Person_Of_Interest_s01e09_1_0.26.56.769-0.27.01.204.mp3", "But it's too dangerous to play in the field by you.", ""],
["Person_Of_Interest_s01e09_1_0.26.59.606-0.27.03.456.mp3", "Your only brother, Naji,", ""],
["Person_Of_Interest_s01e09_1_0.27.01.858-0.27.06.843.mp3", "was killed nine months ago by an IED.", ""],
["Person_Of_Interest_s01e09_1_0.27.05.245-0.27.11.214.mp3", "You visit his grave every day.", ""],
["Person_Of_Interest_s01e09_1_0.27.09.616-0.27.14.884.mp3", "So, you see...", ""],
["Person_Of_Interest_s01e09_1_0.27.13.286-0.27.19.105.mp3", "You are not just a negotiation...", ""],
["Person_Of_Interest_s01e09_1_0.27.17.507-0.27.21.274.mp3", "Not to me.", ""],
["Person_Of_Interest_s01e09_1_0.27.22.577-0.27.25.778.mp3", "Do you have children?", ""],
["Person_Of_Interest_s01e09_1_0.27.24.180-0.27.28.397.mp3", "A son. Taylor.", ""],
["Person_Of_Interest_s01e09_1_0.27.26.799-0.27.31.183.mp3", "Would you trust his life to a complete stranger?", ""],
["Person_Of_Interest_s01e09_1_0.27.29.585-0.27.34.820.mp3", "I'd do whatever was in my power to protect him.", ""],
["Person_Of_Interest_s01e09_1_0.27.33.222-0.27.38.157.mp3", "You lost your brother, Yusuf.", ""],
["Person_Of_Interest_s01e09_1_0.27.38.478-0.27.44.080.mp3", "I lost someone very close to me too.", ""],
["Person_Of_Interest_s01e09_1_0.27.42.482-0.27.47.583.mp3", "It changed everything.", ""],
["Person_Of_Interest_s01e09_1_0.27.45.985-0.27.48.834.mp3", "You and me...", ""],
["Person_Of_Interest_s01e09_1_0.27.47.236-0.27.50.920.mp3", "We're not that different.", ""],
["Person_Of_Interest_s01e09_1_0.27.49.322-0.27.52.004.mp3", "No.", ""],
["Person_Of_Interest_s01e09_1_0.27.50.406-0.27.54.206.mp3", "We want the same thing.", ""],
["Person_Of_Interest_s01e09_1_0.27.52.608-0.27.56.875.mp3", "For our children to walk down the street", ""],
["Person_Of_Interest_s01e09_1_0.27.55.277-0.28.01.147.mp3", "and not be afraid.", ""],
["Person_Of_Interest_s01e09_1_0.27.59.549-0.28.06.051.mp3", "Show me where those explosives are.", ""],
["Person_Of_Interest_s01e09_1_0.28.09.958-0.28.14.076.mp3", "The location is not on the map.", ""],
["Person_Of_Interest_s01e09_1_0.28.12.478-0.28.17.113.mp3", "Then you'll take us to them.", ""],
["Person_Of_Interest_s01e09_1_0.28.15.515-0.28.19.415.mp3", "For our children.", ""],
["Person_Of_Interest_s01e09_1_0.28.21.019-0.28.25.454.mp3", "For our children.", ""],
["Person_Of_Interest_s01e09_1_0.28.33.332-0.28.37.249.mp3", "Hey, BC.", ""],
["Person_Of_Interest_s01e09_1_0.28.35.651-0.28.39.769.mp3", "You got anything on Hector's new woman?", ""],
["Person_Of_Interest_s01e09_1_0.28.38.171-0.28.42.588.mp3", "Relax. Fusco's all right.", ""],
["Person_Of_Interest_s01e09_1_0.28.40.990-0.28.44.690.mp3", "Easy there, hubcap. I don't bite.", ""],
["Person_Of_Interest_s01e09_1_0.28.43.092-0.28.48.427.mp3", "All right, let's make this quick.", ""],
["Person_Of_Interest_s01e09_1_0.28.46.829-0.28.51.280.mp3", "I seen Hector's GTO outside the lookie-loo.", ""],
["Person_Of_Interest_s01e09_1_0.28.49.682-0.28.55.234.mp3", "Turns out he's bumping one of the dancers-- Mei Li.", ""],
["Person_Of_Interest_s01e09_1_0.28.53.636-0.28.58.070.mp3", "If you ask ask me, Hector got a little tired of his chica", ""],
["Person_Of_Interest_s01e09_1_0.28.56.472-0.29.00.272.mp3", "and wanted some strange.", ""],
["Person_Of_Interest_s01e09_1_0.28.58.674-0.29.02.959.mp3", "You done good.", ""],
["Person_Of_Interest_s01e09_1_0.29.01.361-0.29.06.579.mp3", "Uh, I thought you said...", ""],
["Person_Of_Interest_s01e09_1_0.29.04.981-0.29.08.280.mp3", "You know, real money...", ""],
["Person_Of_Interest_s01e09_1_0.29.06.682-0.29.09.498.mp3", "Reward money.", ""],
["Person_Of_Interest_s01e09_1_0.29.07.900-0.29.10.800.mp3", "Okay.", ""],
["Person_Of_Interest_s01e09_1_0.29.09.202-0.29.13.836.mp3", "Well, if this pans out, I will get you that reward money.", ""],
["Person_Of_Interest_s01e09_1_0.29.12.238-0.29.15.621.mp3", "I'll meet you later,", ""],
["Person_Of_Interest_s01e09_1_0.29.14.023-0.29.17.807.mp3", "even take you to dinner at your favorite spot.", ""],
["Person_Of_Interest_s01e09_1_0.29.16.209-0.29.19.725.mp3", "All right.", ""],
["Person_Of_Interest_s01e09_1_0.29.18.127-0.29.21.894.mp3", "Yeah, but only 'cause it's you.", ""],
["Person_Of_Interest_s01e09_1_0.29.20.296-0.29.23.763.mp3", "You always been good to me, Carter.", ""],
["Person_Of_Interest_s01e09_1_0.29.22.165-0.29.25.648.mp3", "Okay. Take care.", ""],
["Person_Of_Interest_s01e09_1_0.29.26.051-0.29.30.186.mp3", "Yes, me and Hector was together all night.", ""],
["Person_Of_Interest_s01e09_1_0.29.28.588-0.29.32.605.mp3", "We watched tv, and then we went to bed.", ""],
["Person_Of_Interest_s01e09_1_0.29.31.007-0.29.34.273.mp3", "- What'd you watch? - I don't know.", ""],
["Person_Of_Interest_s01e09_1_0.29.32.675-0.29.36.158.mp3", "Hector's always changing the channels.", ""],
["Person_Of_Interest_s01e09_1_0.29.34.560-0.29.38.027.mp3", "I heard that about that guy.", ""],
["Person_Of_Interest_s01e09_1_0.29.36.429-0.29.40.746.mp3", "He gets bored, he likes to switch it up, huh?", ""],
["Person_Of_Interest_s01e09_1_0.29.39.148-0.29.44.200.mp3", "Is that why he has that other girl on the side?", ""],
["Person_Of_Interest_s01e09_1_0.29.42.602-0.29.46.452.mp3", "No, no, no.", ""],
["Person_Of_Interest_s01e09_1_0.29.44.854-0.29.48.621.mp3", "You see, my man don't step out on me.", ""],
["Person_Of_Interest_s01e09_1_0.29.47.023-0.29.49.839.mp3", "I'll cut it off.", ""],
["Person_Of_Interest_s01e09_1_0.29.48.241-0.29.50.923.mp3", "Ooh, okay.", ""],
["Person_Of_Interest_s01e09_1_0.29.49.325-0.29.54.760.mp3", "Come here. I want you to see something.", ""],
["Person_Of_Interest_s01e09_1_0.29.53.162-0.29.58.631.mp3", "That's Hector's cell phone bill.", ""],
["Person_Of_Interest_s01e09_1_0.29.57.033-0.29.59.932.mp3", "You know whose number that is?", ""],
["Person_Of_Interest_s01e09_1_0.29.58.334-0.30.01.934.mp3", "'Cause he dialed it 33 times.", ""],
["Person_Of_Interest_s01e09_1_0.30.00.336-0.30.03.436.mp3", "I don't know, it's probably one of his homies.", ""],
["Person_Of_Interest_s01e09_1_0.30.01.838-0.30.05.221.mp3", "That man gossips like a little schoolgirl.", ""],
["Person_Of_Interest_s01e09_1_0.30.03.623-0.30.07.189.mp3", "Well, it's easy enough to find out.", ""],
["Person_Of_Interest_s01e09_1_0.30.05.591-0.30.08.607.mp3", "Go ahead. Dial it.", ""],
["Person_Of_Interest_s01e09_1_0.30.07.009-0.30.10.142.mp3", "So you were with Hector all night.", ""],
["Person_Of_Interest_s01e09_1_0.30.08.544-0.30.12.845.mp3", "Last night, this morning.", ""],
["Person_Of_Interest_s01e09_1_0.30.11.247-0.30.14.697.mp3", "Hector's a morning person.", ""],
["Person_Of_Interest_s01e09_1_0.30.13.099-0.30.17.349.mp3", "He likes to spoon.", ""],
["Person_Of_Interest_s01e09_1_0.30.15.751-0.30.19.118.mp3", "Hello?", ""],
["Person_Of_Interest_s01e09_1_0.30.19.187-0.30.22.371.mp3", "Hello?", ""],
["Person_Of_Interest_s01e09_1_0.30.20.773-0.30.23.689.mp3", "Who is this?", ""],
["Person_Of_Interest_s01e09_1_0.30.22.091-0.30.27.192.mp3", "Wait. Who the hell are you?", ""],
["Person_Of_Interest_s01e09_1_0.30.25.594-0.30.28.861.mp3", "Okay, all right. Whoa, whoa, whoa.", ""],
["Person_Of_Interest_s01e09_1_0.30.27.263-0.30.31.047.mp3", "Looks like you two got a lot to sort out.", ""],
["Person_Of_Interest_s01e09_1_0.30.29.449-0.30.33.632.mp3", "Uh, make sure they don't kill each other.", ""],
["Person_Of_Interest_s01e09_1_0.30.32.034-0.30.34.867.mp3", "- Oh, no! - Oh, no!", ""],
["Person_Of_Interest_s01e09_1_0.30.33.269-0.30.37.069.mp3", "- You got to be kidding me! - Aah! Aah!", ""],
["Person_Of_Interest_s01e09_1_0.30.37.240-0.30.40.840.mp3", "Carter, looks like you're not the only one", ""],
["Person_Of_Interest_s01e09_1_0.30.39.242-0.30.42.207.mp3", "who's got a beef with Hector Alvarez.", ""],
["Person_Of_Interest_s01e09_1_0.30.40.609-0.30.45.394.mp3", "Some guy came into his body shop and shot up the place.", ""],
["Person_Of_Interest_s01e09_1_0.30.43.796-0.30.47.430.mp3", "Bangers inside got a taste of their own medicines.", ""],
["Person_Of_Interest_s01e09_1_0.30.45.832-0.30.49.348.mp3", "Said the guy had a submachine gun", ""],
["Person_Of_Interest_s01e09_1_0.30.47.750-0.30.51.817.mp3", "and a grenade launcher.", ""],
["Person_Of_Interest_s01e09_1_0.30.50.219-0.30.53.719.mp3", "You believe that?", ""],
["Person_Of_Interest_s01e09_1_0.30.52.121-0.30.55.488.mp3", "This guy wearing a suit?", ""],
["Person_Of_Interest_s01e09_1_0.30.53.890-0.30.57.239.mp3", "No, motorcycle jacket. Why?", ""],
["Person_Of_Interest_s01e09_1_0.30.55.641-0.30.59.442.mp3", "Maybe it's in the cleaners.", ""],
["Person_Of_Interest_s01e09_1_0.30.57.844-0.31.00.910.mp3", "Hector's wanted for questioning.", ""],
["Person_Of_Interest_s01e09_1_0.30.59.312-0.31.03.079.mp3", "Suffice it to say, he's, uh, disappeared.", ""],
["Person_Of_Interest_s01e09_1_0.31.02.631-0.31.06.198.mp3", "Somebody knows where he is.", ""],
["Person_Of_Interest_s01e09_1_0.31.04.600-0.31.09.902.mp3", "If I find Hector, I'll give him your best.", ""],
["Person_Of_Interest_s01e09_1_0.31.08.304-0.31.12.538.mp3", "Hector's on the run.", ""],
["Person_Of_Interest_s01e09_1_0.31.10.940-0.31.14.290.mp3", "He's not gonna be a problem for Carter anymore.", ""],
["Person_Of_Interest_s01e09_1_0.31.12.692-0.31.15.574.mp3", "I'm not so sure about that.", ""],
["Person_Of_Interest_s01e09_1_0.31.13.976-0.31.17.877.mp3", "Carter is now determined to get justice for Ronnie.", ""],
["Person_Of_Interest_s01e09_1_0.31.16.279-0.31.20.096.mp3", "One way or another, she will find where Hector's hiding.", ""],
["Person_Of_Interest_s01e09_1_0.31.18.498-0.31.23.132.mp3", "The guy's running guns.", ""],
["Person_Of_Interest_s01e09_1_0.31.21.534-0.31.25.468.mp3", "Wherever he is, he's heavily armed.", ""],
["Person_Of_Interest_s01e09_1_0.31.23.870-0.31.26.936.mp3", "And when she goes to arrest him--", ""],
["Person_Of_Interest_s01e09_1_0.31.25.338-0.31.29.355.mp3", "- I'll just have to get there first.", ""],
["Person_Of_Interest_s01e09_1_0.31.27.757-0.31.32.892.mp3", "Is everything okay, Mr. Reese?", ""],
["Person_Of_Interest_s01e09_1_0.31.34.179-0.31.38.581.mp3", "We got into this to stop bad things", ""],
["Person_Of_Interest_s01e09_1_0.31.36.983-0.31.41.600.mp3", "from happening to good people.", ""],
["Person_Of_Interest_s01e09_1_0.31.40.002-0.31.44.904.mp3", "Carter's been doing that her whole life.", ""],
["Person_Of_Interest_s01e09_1_0.31.43.306-0.31.48.340.mp3", "She's not just another number, Finch.", ""],
["Person_Of_Interest_s01e09_1_0.31.48.143-0.31.53.412.mp3", "Some people the world can't afford to lose.", ""],
["Person_Of_Interest_s01e09_1_0.31.51.814-0.31.55.464.mp3", "Either one of you ready to make a statement?", ""],
["Person_Of_Interest_s01e09_1_0.31.53.866-0.31.57.633.mp3", "Yeah, I got a statement.", ""],
["Person_Of_Interest_s01e09_1_0.31.56.035-0.31.59.385.mp3", "Hector Alvarez is a damn fool", ""],
["Person_Of_Interest_s01e09_1_0.31.57.787-0.32.02.304.mp3", "if he thinks he can play us both.", ""],
["Person_Of_Interest_s01e09_1_0.32.00.706-0.32.04.590.mp3", "Bastard came to my place, but he went out around midnight.", ""],
["Person_Of_Interest_s01e09_1_0.32.02.992-0.32.07.059.mp3", " did he go to the market? - What he said.", ""],
["Person_Of_Interest_s01e09_1_0.32.05.461-0.32.10.128.mp3", "But he came back empty-handed and changed his shirt.", ""],
["Person_Of_Interest_s01e09_1_0.32.08.530-0.32.12.314.mp3", "You wash this shirt of his?", ""],
["Person_Of_Interest_s01e09_1_0.32.10.716-0.32.13.599.mp3", "Oh, hell, no.", ""],
["Person_Of_Interest_s01e09_1_0.32.12.001-0.32.17.319.mp3", "It's all yours along with all his stuff.", ""],
["Person_Of_Interest_s01e09_1_0.32.15.721-0.32.20.573.mp3", "So where is Hector?", ""],
["Person_Of_Interest_s01e09_1_0.32.18.975-0.32.24.243.mp3", "He has a warehouse in Queens...", ""],
["Person_Of_Interest_s01e09_1_0.32.22.645-0.32.25.828.mp3", "On 25th.", ""],
["Person_Of_Interest_s01e09_1_0.32.24.230-0.32.28.998.mp3", "He hangs out there sometimes when he's expecting a shipment.", ""],
["Person_Of_Interest_s01e09_1_0.32.27.400-0.32.31.951.mp3", "Call ESU, get a ten standby.", ""],
["Person_Of_Interest_s01e09_1_0.32.30.353-0.32.33.485.mp3", "I'm gonna see about getting a warrant.", ""],
["Person_Of_Interest_s01e09_1_0.32.31.887-0.32.35.454.mp3", "Hello?", ""],
["Person_Of_Interest_s01e09_1_0.32.33.856-0.32.36.589.mp3", "He's got a gun!", ""],
["Person_Of_Interest_s01e09_1_0.32.34.991-0.32.37.873.mp3", "Uh, wait a minute. Calm down.", ""],
["Person_Of_Interest_s01e09_1_0.32.36.275-0.32.39.358.mp3", "- I can't understand you. - He's got a gun!", ""],
["Person_Of_Interest_s01e09_1_0.32.37.760-0.32.41.460.mp3", "- Get out of there! - Oh, God! Please!", ""],
["Person_Of_Interest_s01e09_1_0.32.39.862-0.32.43.161.mp3", "He's gonna kill me! Hurry!", ""],
["Person_Of_Interest_s01e09_1_0.32.41.563-0.32.44.830.mp3", "Mrs. Kovach, where are you?", ""],
["Person_Of_Interest_s01e09_1_0.32.43.232-0.32.46.832.mp3", "- In the bathroom! - Stay where you are.", ""],
["Person_Of_Interest_s01e09_1_0.32.45.234-0.32.48.467.mp3", "I'm gonna come and get you.", ""],
["Person_Of_Interest_s01e09_1_0.32.46.869-0.32.50.553.mp3", "Hello? Hello?", ""],
["Person_Of_Interest_s01e09_1_0.32.48.955-0.32.53.171.mp3", "Carter's going to the Kovachs' house.", ""],
["Person_Of_Interest_s01e09_1_0.32.51.573-0.32.57.309.mp3", "He's armed, sounds extremely agitated.", ""],
["Person_Of_Interest_s01e09_1_0.32.55.711-0.32.59.979.mp3", "Reese?", ""],
["Person_Of_Interest_s01e09_1_0.32.58.381-0.33.01.313.mp3", "Where are you?", ""],
["Person_Of_Interest_s01e09_1_0.32.59.715-0.33.02.781.mp3", "All units, we have a code ten.", ""],
["Person_Of_Interest_s01e09_1_0.33.01.183-0.33.05.684.mp3", "Shots fired at 326 Greentree in Flushing.", ""],
["Person_Of_Interest_s01e09_1_0.33.04.086-0.33.07.736.mp3", "NYPD, open up!", ""],
["Person_Of_Interest_s01e09_1_0.33.07.588-0.33.10.706.mp3", "Sure we shouldn't wait for backup?", ""],
["Person_Of_Interest_s01e09_1_0.33.09.108-0.33.12.357.mp3", " I got a bad feeling about this. - Mr. Kovach...", ""],
["Person_Of_Interest_s01e09_1_0.33.10.759-0.33.15.360.mp3", "It's the police. Put down your weapon.", ""],
["Person_Of_Interest_s01e09_1_0.33.18.266-0.33.23.552.mp3", "What the hell?", ""],
["Person_Of_Interest_s01e09_1_0.33.24.739-0.33.28.040.mp3", "Somebody gift-wrapped him for us.", ""],
["Person_Of_Interest_s01e09_1_0.33.26.442-0.33.31.209.mp3", "Somebody's been doing that a lot lately.", ""],
["Person_Of_Interest_s01e09_1_0.33.29.611-0.33.33.395.mp3", "Mrs. Kovach?", ""],
["Person_Of_Interest_s01e09_1_0.33.31.797-0.33.35.314.mp3", "Mrs. Kovach?", ""],
["Person_Of_Interest_s01e09_1_0.33.39.138-0.33.42.488.mp3", "Mrs. Kovach, are you okay?", ""],
["Person_Of_Interest_s01e09_1_0.33.40.890-0.33.45.941.mp3", "He was gonna kill me. If that man hadn't shown up--", ""],
["Person_Of_Interest_s01e09_1_0.33.44.343-0.33.48.244.mp3", "- \"That man\"? What'd he look like?", ""],
["Person_Of_Interest_s01e09_1_0.33.46.646-0.33.51.363.mp3", "Hello?", ""],
["Person_Of_Interest_s01e09_1_0.33.53.184-0.33.57.503.mp3", "It's for you.", ""],
["Person_Of_Interest_s01e09_1_0.33.59.607-0.34.03.342.mp3", "I guess I have you to thank for this.", ""],
["Person_Of_Interest_s01e09_1_0.34.01.744-0.34.04.927.mp3", "How do you always know", ""],
["Person_Of_Interest_s01e09_1_0.34.03.329-0.34.06.011.mp3", "when something bad's about to go down?", ""],
["Person_Of_Interest_s01e09_1_0.34.04.413-0.34.08.213.mp3", "You're in trouble, detective.", ""],
["Person_Of_Interest_s01e09_1_0.34.06.615-0.34.11.583.mp3", "I'm not the one who's hiding.", ""],
["Person_Of_Interest_s01e09_1_0.34.09.985-0.34.14.219.mp3", "Look, you keep playing God, and sooner or later,", ""],
["Person_Of_Interest_s01e09_1_0.34.12.621-0.34.16.088.mp3", "an innocent person's gonna get hurt.", ""],
["Person_Of_Interest_s01e09_1_0.34.14.490-0.34.17.189.mp3", "I can't let that happen.", ""],
["Person_Of_Interest_s01e09_1_0.34.15.591-0.34.19.275.mp3", "Listen, I didn't call to talk about me.", ""],
["Person_Of_Interest_s01e09_1_0.34.17.677-0.34.20.526.mp3", "Your life's in danger.", ""],
["Person_Of_Interest_s01e09_1_0.34.18.928-0.34.23.779.mp3", "I'm a cop. My life's always in danger.", ""],
["Person_Of_Interest_s01e09_1_0.34.22.181-0.34.25.281.mp3", "You're not listening to me.", ""],
["Person_Of_Interest_s01e09_1_0.34.23.683-0.34.28.200.mp3", "I'm trying to tell you someone wants you dead.", ""],
["Person_Of_Interest_s01e09_1_0.34.28.386-0.34.32.437.mp3", "Who told you that?", ""],
["Person_Of_Interest_s01e09_1_0.34.30.839-0.34.35.291.mp3", "Why are you following me? What do you want?", ""],
["Person_Of_Interest_s01e09_1_0.34.33.693-0.34.37.376.mp3", "I want you to start being more careful.", ""],
["Person_Of_Interest_s01e09_1_0.34.35.778-0.34.40.379.mp3", "For instance, if you're gonna take down Hector Alvarez,", ""],
["Person_Of_Interest_s01e09_1_0.34.38.781-0.34.42.381.mp3", "you should know the man's running guns.", ""],
["Person_Of_Interest_s01e09_1_0.34.40.783-0.34.44.800.mp3", "He has an arsenal at his fingertips.", ""],
["Person_Of_Interest_s01e09_1_0.34.43.202-0.34.47.786.mp3", "What-- Why are you helping me?", ""],
["Person_Of_Interest_s01e09_1_0.34.46.188-0.34.50.622.mp3", "And how do you keep finding out all of this information?", ""],
["Person_Of_Interest_s01e09_1_0.34.49.024-0.34.51.957.mp3", "Like you said...", ""],
["Person_Of_Interest_s01e09_1_0.34.50.359-0.34.54.626.mp3", "I always seem to know.", ""],
["Person_Of_Interest_s01e09_1_0.35.12.564-0.35.15.748.mp3", "I never saw his face.", ""],
["Person_Of_Interest_s01e09_1_0.35.14.150-0.35.17.366.mp3", "He came out of nowhere.", ""],
["Person_Of_Interest_s01e09_1_0.35.15.768-0.35.20.536.mp3", "He attacked me. You people can't arrest me.", ""],
["Person_Of_Interest_s01e09_1_0.35.18.938-0.35.21.537.mp3", "Yes, we can.", ""],
["Person_Of_Interest_s01e09_1_0.35.19.939-0.35.24.957.mp3", "Your wife is pressing charges, Eddie.", ""],
["Person_Of_Interest_s01e09_1_0.35.23.359-0.35.26.825.mp3", "We get a warrant on Hector Alvarez yet?", ""],
["Person_Of_Interest_s01e09_1_0.35.25.227-0.35.31.013.mp3", "Yep, ESU's standing by. Who died?", ""],
["Person_Of_Interest_s01e09_1_0.35.49.970-0.35.54.272.mp3", "Finch, Carter's called an ESU unit", ""],
["Person_Of_Interest_s01e09_1_0.35.52.674-0.35.56.441.mp3", "to Hector's warehouse in queens.", ""],
["Person_Of_Interest_s01e09_1_0.35.54.843-0.35.59.411.mp3", "They're getting ready to knock on the door as we speak.", ""],
["Person_Of_Interest_s01e09_1_0.36.02.016-0.36.05.517.mp3", "It's time to roll. Stay here.", ""],
["Person_Of_Interest_s01e09_1_0.36.03.919-0.36.08.203.mp3", "I'll advise you when we have Alvarez apprehended.", ""],
["Person_Of_Interest_s01e09_1_0.36.06.605-0.36.09.921.mp3", "You have eyes on Carter?", ""],
["Person_Of_Interest_s01e09_1_0.36.08.323-0.36.11.706.mp3", "She's clear of the line of fire.", ""],
["Person_Of_Interest_s01e09_1_0.36.10.108-0.36.14.042.mp3", "If Hector puts up a fight, it could be dangerous.", ""],
["Person_Of_Interest_s01e09_1_0.36.12.444-0.36.16.344.mp3", "How will you be close enough to protect her?", ""],
["Person_Of_Interest_s01e09_1_0.36.14.746-0.36.17.345.mp3", "Oh, I'm...", ""],
["Person_Of_Interest_s01e09_1_0.36.15.747-0.36.18.630.mp3", "Pretty close.", ""],
["Person_Of_Interest_s01e09_1_0.36.17.032-0.36.20.215.mp3", "They got this place covered, right?", ""],
["Person_Of_Interest_s01e09_1_0.36.18.617-0.36.21.266.mp3", "Absolutely.", ""],
["Person_Of_Interest_s01e09_1_0.36.19.668-0.36.22.934.mp3", "Cover's going in.", ""],
["Person_Of_Interest_s01e09_1_0.36.21.336-0.36.24.436.mp3", "- Everybody set? - Yes, sir.", ""],
["Person_Of_Interest_s01e09_1_0.36.22.838-0.36.26.521.mp3", "Open it.", ""],
["Person_Of_Interest_s01e09_1_0.36.24.923-0.36.28.106.mp3", "Do it.", ""],
["Person_Of_Interest_s01e09_1_0.36.26.508-0.36.30.108.mp3", "Move! Move! Move! NYPD!", ""],
["Person_Of_Interest_s01e09_1_0.36.28.510-0.36.33.344.mp3", "Down on the ground now!", ""],
["Person_Of_Interest_s01e09_1_0.36.31.746-0.36.36.064.mp3", "That doesn't sound good.", ""],
["Person_Of_Interest_s01e09_1_0.36.37.519-0.36.42.737.mp3", "You hear something around back?", ""],
["Person_Of_Interest_s01e09_1_0.37.00.541-0.37.04.342.mp3", "Get out of the car.", ""],
["Person_Of_Interest_s01e09_1_0.37.02.744-0.37.06.261.mp3", "Suspect apprehended.", ""],
["Person_Of_Interest_s01e09_1_0.37.04.663-0.37.07.879.mp3", "Take it easy.", ""],
["Person_Of_Interest_s01e09_1_0.37.06.281-0.37.09.731.mp3", "Everything all right, Mr. Reese?", ""],
["Person_Of_Interest_s01e09_1_0.37.08.133-0.37.11.382.mp3", "Hector's got a new set of bracelets.", ""],
["Person_Of_Interest_s01e09_1_0.37.09.784-0.37.14.235.mp3", "Should keep him busy for a while.", ""],
["Person_Of_Interest_s01e09_1_0.37.12.637-0.37.16.071.mp3", "That's for Ronnie.", ""],
["Person_Of_Interest_s01e09_1_0.37.14.473-0.37.19.724.mp3", "- I told you I'd get you. - Oh, God.", ""],
["Person_Of_Interest_s01e09_1_0.37.19.626-0.37.23.611.mp3", "Hey, Taylor, baby. I'm running a little late.", ""],
["Person_Of_Interest_s01e09_1_0.37.22.013-0.37.27.248.mp3", "I'll be there soon.", ""],
["Person_Of_Interest_s01e09_1_0.37.25.650-0.37.29.951.mp3", "Sounds like Carter's headed home.", ""],
["Person_Of_Interest_s01e09_1_0.37.28.353-0.37.31.736.mp3", "Made it through the day.", ""],
["Person_Of_Interest_s01e09_1_0.37.30.138-0.37.33.671.mp3", "Have we eliminated the threat yet?", ""],
["Person_Of_Interest_s01e09_1_0.37.32.073-0.37.38.209.mp3", "Kovach and Alvarez are neutralized.", ""],
["Person_Of_Interest_s01e09_1_0.37.36.611-0.37.40.095.mp3", "But this is a tricky case.", ""],
["Person_Of_Interest_s01e09_1_0.37.38.497-0.37.43.381.mp3", "To be perfectly honest, I'm just...", ""],
["Person_Of_Interest_s01e09_1_0.37.41.783-0.37.44.516.mp3", "Not sure.", ""],
["Person_Of_Interest_s01e09_1_0.37.42.918-0.37.46.384.mp3", "Finch, Carter lives uptown.", ""],
["Person_Of_Interest_s01e09_1_0.37.44.786-0.37.48.553.mp3", "So why is she headed downtown?", ""],
["Person_Of_Interest_s01e09_1_0.37.46.955-0.37.49.938.mp3", "Wait a minute.", ""],
["Person_Of_Interest_s01e09_1_0.37.48.340-0.37.52.190.mp3", "Where'd she go?", ""],
["Person_Of_Interest_s01e09_1_0.37.52.743-0.37.56.144.mp3", "I lost her.", ""],
["Person_Of_Interest_s01e09_1_0.37.54.546-0.37.59.364.mp3", "Track her phone for me.", ""],
["Person_Of_Interest_s01e09_1_0.38.02.102-0.38.04.702.mp3", "Where you been?", ""],
["Person_Of_Interest_s01e09_1_0.38.03.104-0.38.06.237.mp3", "You said you was gonna buy me dinner.", ""],
["Person_Of_Interest_s01e09_1_0.38.04.639-0.38.07.906.mp3", "Where you been? I been waiting.", ""],
["Person_Of_Interest_s01e09_1_0.38.06.308-0.38.10.107.mp3", "I'm sorry, BC. I got to fill out a requisition", ""],
["Person_Of_Interest_s01e09_1_0.38.08.509-0.38.13.027.mp3", "for the big payout.", ""],
["Person_Of_Interest_s01e09_1_0.38.11.429-0.38.15.713.mp3", "But look, why don't you take whatever I got?", ""],
["Person_Of_Interest_s01e09_1_0.38.14.115-0.38.17.298.mp3", "No, that's all right. You ain't got to do all that.", ""],
["Person_Of_Interest_s01e09_1_0.38.15.700-0.38.19.300.mp3", "Let's just call this a down payment, okay?", ""],
["Person_Of_Interest_s01e09_1_0.38.17.702-0.38.22.253.mp3", "I want you to have that.", ""],
["Person_Of_Interest_s01e09_1_0.38.20.655-0.38.23.805.mp3", "I'm sorry, Carter.", ""],
["Person_Of_Interest_s01e09_1_0.38.22.207-0.38.25.473.mp3", "You always been good to me,", ""],
["Person_Of_Interest_s01e09_1_0.38.23.875-0.38.29.260.mp3", "but I ain't got no choice.", ""],
["Person_Of_Interest_s01e09_1_0.38.27.662-0.38.33.848.mp3", "You told me to find that guy Elias.", ""],
["Person_Of_Interest_s01e09_1_0.38.32.250-0.38.35.433.mp3", "Well, I found him.", ""],
["Person_Of_Interest_s01e09_1_0.38.36.637-0.38.40.905.mp3", "Sorry.", ""],
["Person_Of_Interest_s01e09_1_0.38.39.307-0.38.43.474.mp3", "He said it's either gonna be you or me.", ""],
["Person_Of_Interest_s01e09_1_0.38.41.876-0.38.46.244.mp3", "And it ain't gonna be me.", ""],
["Person_Of_Interest_s01e09_1_0.39.01.111-0.39.04.429.mp3", "Look alive, Carter.", ""],
["Person_Of_Interest_s01e09_1_0.39.04.698-0.39.07.932.mp3", "About all that's left of that storage facility", ""],
["Person_Of_Interest_s01e09_1_0.39.06.334-0.39.09.300.mp3", "your friend took us to.", ""],
["Person_Of_Interest_s01e09_1_0.39.07.702-0.39.11.519.mp3", "You found the explosives.", ""],
["Person_Of_Interest_s01e09_1_0.39.09.921-0.39.13.004.mp3", "Found and detonated.", ""],
["Person_Of_Interest_s01e09_1_0.39.11.406-0.39.16.441.mp3", "I, uh, couldn't have done what you did,", ""],
["Person_Of_Interest_s01e09_1_0.39.14.843-0.39.20.278.mp3", "getting information from that raghead.", ""],
["Person_Of_Interest_s01e09_1_0.39.18.680-0.39.23.514.mp3", "Where's Yusuf?", ""],
["Person_Of_Interest_s01e09_1_0.39.21.916-0.39.27.902.mp3", "Yeah, he, uh... Didn't make it back.", ""],
["Person_Of_Interest_s01e09_1_0.39.26.304-0.39.31.689.mp3", "Accidents happen.", ""],
["Person_Of_Interest_s01e09_1_0.39.30.091-0.39.34.692.mp3", "He trusted me.", ""],
["Person_Of_Interest_s01e09_1_0.39.33.094-0.39.38.746.mp3", "I gave him my word. I-I promised I'd protect him.", ""],
["Person_Of_Interest_s01e09_1_0.39.37.148-0.39.41.716.mp3", "You shouldn't make promises you can't keep.", ""],
["Person_Of_Interest_s01e09_1_0.39.40.118-0.39.44.085.mp3", "Come on, you don't think this guy was innocent, do you?", ""],
["Person_Of_Interest_s01e09_1_0.39.42.487-0.39.46.704.mp3", "He had a family.", ""],
["Person_Of_Interest_s01e09_1_0.39.45.106-0.39.49.040.mp3", "Don't you care what happens to them?", ""],
["Person_Of_Interest_s01e09_1_0.39.47.442-0.39.51.593.mp3", "It's not my job to care.", ""],
["Person_Of_Interest_s01e09_1_0.39.49.995-0.39.54.229.mp3", "What is wrong with you?", ""],
["Person_Of_Interest_s01e09_1_0.39.52.631-0.39.56.431.mp3", "You can't just play God!", ""],
["Person_Of_Interest_s01e09_1_0.39.54.833-0.39.59.684.mp3", "You don't get to decide who lives and who dies!", ""],
["Person_Of_Interest_s01e09_1_0.39.58.086-0.40.03.655.mp3", "You want to stand on your high horse, go ahead.", ""],
["Person_Of_Interest_s01e09_1_0.40.02.057-0.40.06.324.mp3", "But don't expect me and my men to back you up.", ""],
["Person_Of_Interest_s01e09_1_0.40.04.726-0.40.08.109.mp3", "It's a long war.", ""],
["Person_Of_Interest_s01e09_1_0.40.06.511-0.40.10.995.mp3", "And you're all alone.", ""],
["Person_Of_Interest_s01e09_1_0.40.17.688-0.40.20.672.mp3", "Glad you took my advice", ""],
["Person_Of_Interest_s01e09_1_0.40.19.074-0.40.23.541.mp3", "about wearing that vest, detective.", ""],
["Person_Of_Interest_s01e09_1_0.40.21.943-0.40.25.576.mp3", "I know this doesn't change anything.", ""],
["Person_Of_Interest_s01e09_1_0.40.23.978-0.40.27.929.mp3", "I know you'll still arrest me if you get the chance.", ""],
["Person_Of_Interest_s01e09_1_0.40.26.331-0.40.30.247.mp3", "But you should know,", ""],
["Person_Of_Interest_s01e09_1_0.40.28.649-0.40.32.917.mp3", "whether you like me or not, Joss,", ""],
["Person_Of_Interest_s01e09_1_0.40.31.319-0.40.36.020.mp3", "you're not alone.", ""],
["Person_Of_Interest_s01e09_1_0.40.45.599-0.40.49.867.mp3", "Elias got to Carter's CI.", ""],
["Person_Of_Interest_s01e09_1_0.40.48.269-0.40.50.952.mp3", "Turned him into his triggerman.", ""],
["Person_Of_Interest_s01e09_1_0.40.49.354-0.40.53.288.mp3", " is She safe? - For now.", ""],
["Person_Of_Interest_s01e09_1_0.40.51.690-0.40.56.541.mp3", "Time to end this, Finch, once and for all.", ""],
["Person_Of_Interest_s01e09_1_0.40.58.278-0.41.02.630.mp3", "Aah!", ""],
["Person_Of_Interest_s01e09_1_0.41.01.032-0.41.04.966.mp3", "Body falls from this height, it's messy.", ""],
["Person_Of_Interest_s01e09_1_0.41.03.368-0.41.08.285.mp3", "Of course, I don't care about making it look clean...", ""],
["Person_Of_Interest_s01e09_1_0.41.06.687-0.41.09.554.mp3", "Unlike your pal Elias.", ""],
["Person_Of_Interest_s01e09_1_0.41.07.956-0.41.11.306.mp3", "I don't know who you are,", ""],
["Person_Of_Interest_s01e09_1_0.41.09.708-0.41.13.791.mp3", "but you're threatening a captain.", ""],
["Person_Of_Interest_s01e09_1_0.41.12.193-0.41.15.793.mp3", "Okay, okay, okay.", ""],
["Person_Of_Interest_s01e09_1_0.41.14.195-0.41.19.130.mp3", "Elias can't kill a cop without permission.", ""],
["Person_Of_Interest_s01e09_1_0.41.17.532-0.41.21.733.mp3", "Run this up the chain of command.", ""],
["Person_Of_Interest_s01e09_1_0.41.20.135-0.41.23.467.mp3", "Permission's been revoked.", ""],
["Person_Of_Interest_s01e09_1_0.41.21.869-0.41.28.305.mp3", "Tell Elias if he so much as touches Detective Carter again,", ""],
["Person_Of_Interest_s01e09_1_0.41.26.707-0.41.31.993.mp3", "I will put him, you...", ""],
["Person_Of_Interest_s01e09_1_0.41.30.395-0.41.34.412.mp3", "Everyone in the ground.", ""],
["Person_Of_Interest_s01e09_1_0.41.32.814-0.41.36.948.mp3", " You got that? - Yeah.", ""],
["Person_Of_Interest_s01e09_1_0.41.35.350-0.41.41.152.mp3", "Oh. Oh.", ""],
["Person_Of_Interest_s01e09_1_0.41.49.830-0.41.55.266.mp3", "Grandma said you were late for curfew again.", ""],
["Person_Of_Interest_s01e09_1_0.41.53.668-0.41.58.219.mp3", "Oh, come on, ma. You're serious?", ""],
["Person_Of_Interest_s01e09_1_0.41.56.621-0.41.59.721.mp3", "I was at a dance.", ""],
["Person_Of_Interest_s01e09_1_0.41.58.123-0.42.02.774.mp3", "Is she pretty?", ""],
["Person_Of_Interest_s01e09_1_0.42.03.010-0.42.06.944.mp3", "Better be smart too.", ""],
["Person_Of_Interest_s01e09_1_0.42.05.346-0.42.09.280.mp3", "Smart and pretty.", ""],
["Person_Of_Interest_s01e09_1_0.42.13.687-0.42.16.654.mp3", "You all right, mom?", ""],
["Person_Of_Interest_s01e09_1_0.42.15.056-0.42.19.707.mp3", "Did you pull your back or something?", ""],
["Person_Of_Interest_s01e09_1_0.42.18.109-0.42.22.827.mp3", "It's nothing that won't heal.", ""],
["Person_Of_Interest_s01e09_1_0.42.25.149-0.42.29.667.mp3", "Sorry I missed it, t.", ""],
["Person_Of_Interest_s01e09_1_0.42.28.069-0.42.33.421.mp3", "You work too hard. You should quit.", ""],
["Person_Of_Interest_s01e09_1_0.42.31.823-0.42.36.057.mp3", "Wouldn't know how to if I tried.", ""],
["Person_Of_Interest_s01e09_1_0.42.34.459-0.42.39.560.mp3", "I don't like it-- You out there every day.", ""],
["Person_Of_Interest_s01e09_1_0.42.37.962-0.42.41.145.mp3", "Who's got your back?", ""],
["Person_Of_Interest_s01e09_1_0.42.41.882-0.42.46.217.mp3", "You don't have to worry about me.", ""],
["Person_Of_Interest_s01e09_1_0.42.44.619-0.42.49.237.mp3", "I can take care of myself.", ""],
["Person_Of_Interest_s01e09_1_0.42.47.639-0.42.51.555.mp3", "Besides...", ""],
["Person_Of_Interest_s01e09_1_0.42.49.957-0.42.54.409.mp3", "We got each other.", ""],
["Person_Of_Interest_s01e09_1_0.42.52.811-0.42.56.661.mp3", "Who else do we need?", ""]
]);
